"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/7UJBHVzSwYGbmFXSTrGJ5Q/l.jpg",
"rating":"4.0",
"reviewcomment":"After a crazy night, an awesome solution for hangover is to me (and my bff!) is having a bowl of Japanese ramen! Sometimes an instant ramen will do the job but I&#39;m living large nowadays! Harhar~ :-p Just like most Japanese ramen places, this very famous ramen restaurant is of medium to tiny space. Many of my friends are sort of not fond of its space and atmosphere, but I do don&#39;t mind and I actually like them. I think they make this restaurant feel more ... Japanese(?).<br><br>My favourite here is Shoyu (sometimes Shio, harhar). The Shoyu is &#34;Japanese ramen in Kintaro&#39;s special soy sauce soup with pork-bone stock.&#34; Of course, as with every Japanese ramen, it comes with bean sprouts, bamboo shoots, and green onions. And in this case, BBQ porks! Great great &#34;humble food&#34; indeed. Smooth noodles in a bowl of hot soup with fat meat, a perfect cure for hangover, this girl says! I&#39;d keep coming back. Of course you need to choose the time wisely because when it&#39;s not too lined up, you might have to be wait 30~40 minutes. Still, it&#39;s a good sign, yes? ^^",
