"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/Z54PB0ffTQqaN42MSeHvMw/l.jpg",
"rating":"4.0",
"reviewcomment":"My husband and I found ourselves at Meat and Bread after receiving a recommendation from a bartender in Seattle. We were not disappointed. My husband ordered the Porchetta, which is their signature sandwich, and I ordered the daily special, which was a slow roasted lamb sandwich. Both sandwiches were delicious and paired well with the cold Kolsch that we washed them down with. <br><br>The service was quick and everyone was very courteous. When we first walked in to the shop, it was packed and we were unsure of the wait time. The hostess quickly assured us that by the time we finished ordering our sandwiches some space would open up. Sure enough, by the time we got our sandwiches we were able to enjoy them at the long, community table. Between our dining experiences in Seattle and the rest of Vancouver, I have to say that the sandwich I ate at Meat and Bread was probably my favorite meal of the trip.",
