"rating":"3.5",
"reviewcomment":"Vancouver&#39;s late night food scene (or rather lack thereof) was a hole that had yet to be filled in my heart. So when we came to the Naam under many recommendations, this restaurant literally made our night.<br><br>Chill atmosphere if you go late at night and in the afternoon. If you go during the dinner rush though, get ready to wait until your stomach is screaming purgatory. The food is fucking amazing and you don&#39;t have to feel guilty after engorging your digestive tract with this delicious goodness - all of it is damn good for you.<br><br>I&#39;m sounding very much like a broken record here but I have to definitely echo the sentiments of everyone who raves about the miso gravy. It&#39;s gotta be laced with crack to be that good. Try the enchilada; it tastes so amazing I feel like I should be guilty for having it but it&#39;s full of healthy veggies and beans.<br><br>Tl;dr: this is a 24 hour restaurant. Go at night when it&#39;s quiet (because any other time is an aggravating wait). Everything on the menu is fucking majestic.",
