"rating":"3.5",
"reviewcomment":"Stepho&#39;s is awesome. The food is good and affordable. The service is fast and polite. The atmosphere is nice. So why doesn&#39;t everyone come here to grab a bite? The problem is that... they do! Be prepared to wait for ages to get a table, even at non-peak hours!<br><br>The food, like I said, is good and affordable. They offer large portions for very reasonable prices. Growing up with kebabs and pita, I like to think I have a good tongue to critique their dishes, and I&#39;m pleased to say that they deliver. The meat is cooked very well, the rice is delicious, and the salads are good too. Do try the appetizers. I find people skip appetizers a lot in the West but they&#39;ve got a ton of great ones here.<br><br>The service is very good, some of the best I&#39;ve experienced in the area. They are very polite, check with you quite often, and are quick with refreshments. The food is delivered efficiently as well although it does take quite some time to tear through, which may explain why it&#39;s so difficult to find a table!<br><br>Good food, good service, good prices... this place is the perfect storm for a line-up. Bring a good book or two, or someone to make out with while you wait to get a seat.",
