"reviewcomment":"I had my going away party here and I just want to say that Nathan was super helpful. I had a pretty large group (40 or so people) and the servers managed to keep separate bills and I was pretty content with the level of service (although some of my guests felt otherwise). The food was only medium, some items were quite good and others not so much. It is a bit over priced too for what it is. I would think it would be the prices of Earls or Cactus but it is a bit more. I knew that going in but some of my guests did comment on it so be sure to check the menu out before you commit and let people know. And for the price, the food should have been tastier. I heard complaints about the Beef ribs and the curry noodle bowl (not sure of the official names). The onion rings were delicious as was the mushroom flatbread ) thin crust) and cheese cake...people kept offering me bites of what they had.<br><br>But because Nathan came over and checked on us and brought a piece of cake for my 2nd cousin who was turning 75 and brought me a shot and even a t-shirt that people could sign, I am giving what would normally be a 3 a 4. I give him a 5 though for being great at his job.<br><br>I also liked the back area which could accommodate our party and was kind of a separate area. The music was pretty amazing too and they have delicious micro brewed beer. I highly recommend the raspberry wheat ale.<br><br>The patio is also beautiful and the pub side is a great place to go (and from what I remember, a great place to chat up attractive guys and they are more in the 30 age range instead of the 20 somethings at most other pubs).",
