"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/iun25u9YLxdZTUmKHx3MSg/l.jpg",
"rating":"3.5",
"reviewcomment":"I came here on a busy Saturday night for a belated Mother&#39;s Day dinner. Â My mum and I arrived at 7pm for our reservation and were led to a lovely table upstairs which was a little more intimate and quiet. Â Despite my sister not arriving for another 20 minutes, we were never made to feel we were taking up valuable real estate. <br><br>As far as food, between the three of us we ended up ordering the Apple Chopped Salad, Burrata Salad, Halibut Karaage (from the feature sheet), Pan Roasted Sea Scallops, Truffle Crusted Halibut (also a feature), Crispy Brussels Sprouts and Truffle Fries. Â Everything I tasted (pretty much everything on the table) was delicious - I had the halibut appetizer and the entrÃ©e and both were absolutely divine. Â My mother, who generally finds *something* wrong with everything, absolutely raved about her scallops. Â Unfortunately my sister told me her halibut was almost cold, but she didn&#39;t mention it until after dinner when my mum had left the table, so I can&#39;t put that on the restaurant as I know full well they would have swept her plate away and presented another one without missing a beat.<br><br>Our server, whose name unfortunately escapes me, was excellent from beginning to end. Â She clearly has a knack for &#34;reading&#34; her tables, which is a dying talent in the service world these days. <br><br>I agree that it can be loud if seated in the downstairs area; I do suggest requesting the upstairs if you&#39;re looking for something a little more intimate - I&#39;ve sat at the bar before and it was definitely a different experience being upstairs (though there&#39;s definitely a time and a place to sit at the bar!!). Â All in all, it was a wonderful experience and I would certainly recommend it.",
