"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/UKkbCNFQjylF5yxJY949vA/l.jpg",
"rating":"4.0",
"reviewcomment":"I finally got around to giving this place a try on a date; it was both my and my date&#39;s first time at this place. The concept interested me: vegetarian Mexican food. I was also delighted that the establishment gave customers the option of &#39;vegan-ising&#39; their dishes using Daiya cheese. <br><br>I ordered the Dant&#39;s enchilada dish: corn tortillas stuffed with (Daiya) cheese and butternut squash, asked for the enchilada sauce and the rice-and-beans side. <br><br>The dish was beyond delish. The enchiladas have lots of creaminess and body, no need for meat...did not miss the meat at all! The rice-and-beans side could use a bit more kick but it&#39;s nothing a little bit of hot sauce (provided right at the table) could fix! <br><br>The place itself is typical &#39;Commercial Drive eating joint:&#39; hipster feel, hip people (I definitely felt a tad outta place), hip decor (they turn off the lights at dinner time forcing you to use their table candles (I used the light from my smart phone) to read their menus but I was given very friendly attentive service! I gave their gluten-free chocolate cake a try and it was pretty darn good!<br><br>My memo to the restaurant: PLEASE find out for sure if your tempeh is gluten free. The beauty of Mexican cuisine is that wheat can easily be avoided as Mexican is highly corn based. I did ask the waitress but she said the label has been thrown out, so she could not confirm.",
