"rating":"3.5",
"reviewcomment":"Came here the other day for a friend&#39;s birthday and had a great time. Glowbal has always been a fixture in the heart of Yaletown and it never disappoints. I used to get a lot more joy coming here when I was younger - perhaps because there were less restaurants like Glowbal and it&#39;s starting to get overshadowed by many of the other dining options in the area. <br><br>Anyhow, food was excellent as always. I started with the Satay platter (which was shared). Everything came on a stick which I&#39;m a sucker for. I really enjoyed the albacore tuna and the mac and cheese sticks. Who knew mac and cheese could come on a stick? This is a great little sampler that gives you a little of everything for the indecisive.<br><br>I had the lamb shank for my main. The meat was juicy and tender - cooked to perfection. The size of the dish was a little on the small size (I&#39;m a big eater) but I did have the satay plate to start so the post-dinner Micky-D&#39;s run was not necessary.<br><br>Value-wise, I would say it&#39;s okay. For the price, it&#39;s not an amazing deal but Glowbal is consistent and you know what you&#39;re going to get - excellent food in a nice restaurant. Our server was also very friendly and attentive.<br><br>Oh, and parking&#39;s a B*tch.",
