"reviewcomment":"Visited for the first time seeing that the reviews were raving. Decors are vintage 70&#39;s with decent upkeep and clean washrooms. This venue is a bistro style eatery so it&#39;s fairly casual- staff and patrons dress smart casual. &#34;Possible&#34; place for a date but seats are tightly spaced and ambient chatter is at a mediocre. If you value privacy and quietness fine dining would be more suitable. <br>It&#39;s a very popular place and a reservation would likely be necessary. On a Friday night (and I assume most other nights) reservations are set at 5:30 or 7:30. There are bar seats which seem to be first come first served.<br>Menu is short and simple, about a dozen appetizers and dito for entrees. Specials are written on the blackboard and they are not introduced by the waiter (casual dining). Pricing is a reasonable average of $19. Our party had the Steak Frites (Hanger Steak) and Â FRUITS DE MER PROVENÃAL (assorted seafood in tomato sauce). Both were done to perfection, very fresh seafood and sauce was homemade and not too salty. <br>We split a chocolate mouse cake (forget the exact name) but it had a nutty crust and creamy upper. Very rich, not overly sweet and if you&#39;re not used to eating heavy rich items it&#39;s a good choice for sharing. <br>Although food was great, I would expect better service and slightly &#34;nicer&#34; decors for a 5star wow factor. This venue is comparable to Salade de Fruits.<br>A very trusty venue and I&#39;m sure their quality will continue for years to come.",
