"rating":"4.5",
"reviewcomment":"I came here with a friend for lunch. I was very hesitant to &#34;settle&#34; for Fable because the lunch menu looked so, for a lack of better word, simple. I gave the benefit of the doubt, walked in with no expectations and came out feeling grateful that I made the right decision to dine here.<br><br>My girlfriend and I shared a Chick Pea Fritter. I ordered a vegetarian tagliatelle. She ordered a duck confit salad minus the goat cheese.<br><br>Chick Pea Fritter was a tad salty but the texture was fantastic. Fritters were shaped individually like the size of a golf ball. It had a great crunch on the outside. I am so glad it wasn&#39;t dry. The saltiness balanced beautifully with the slightly sweet curry mayo. Pickled red onions and fresh pea shoots were refreshing.<br><br>My vegetarian tagliatelle knocked my socks off! The broccolini, tomatoes, etc were cooked beautifully. The tagliatelle was very toothsome. The parmesan foam made the pasta creamy but it didn&#39;t make it heavy. I can rave about this pasta dish all day. It was very very good, seasoned perfectly!<br><br>I had a bite of my girlfriend&#39;s duck confit and it was crispy on the outside and tender on the inside. <br><br>Alana, our server, was attentive, friendly, and just wonderful considering the time we went the restaurant was pretty busy.<br><br>Simple food made with lots of love and fresh quality ingredients coupled with superb service, this place deserves a full 5 stars.",
