"rating":"4.0",
"reviewcomment":"Because I was visiting Vancouver with my girlfriend, I knew that I had to take her to the famous Hawksworth restaurant (also nice since we were staying at the Rosewood anyway). Â My first impression as we entered was that this place was quite a hangout for young professionals. Â There seemed to be way too many tables for such a limited dining area. Â We were seated and I realized that we were seated so close to the tables beside us that it felt like we were all dining together as a large group. Â That being said, everything else was perfect. Â <br><br>The food (the only thing I really care about anyways) was immaculate and prepared flawlessly. Â It was edgy and familiar all at the same time. Â I would highly recommend the tandoori grilled sturgeon! Â My girlfriend loved the parmesan crusted chicken (a unique way to prepare chicken, you&#39;ll see). Â You can thank me later. Â Just kidding, thank me now.<br><br>Pros: The FOOD, the attentive waitstaff, the FOOD<br><br>Cons: Intimate but very noisy, felt a bit too crowded",
