"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/OruudSXufCG5b_P1kCueQw/l.jpg",
"rating":"3.5",
"reviewcomment":"We&#39;ve been meaning to try this restaurant for a really long time but it kept getting pushed back. Finally got around to it on a nice sunny day after doing a quick check on OpenTable and making a reservation - nice that you can make one on a weekend for brunch!<br><br>We sat on the patio and it took a good 15mins before we even knew who our server was so we didn&#39;t have high hopes for a faster meal, but thankfully it got better. We ordered the homemade lemonade ($2.50, cheap and good!) and an Earl Grey Tea (so good and creamy, I think it&#39;s from Granville Island Tea Co). For our meals, we ordered the Edible Canada Breakfast (scrambled eggs, a sausage, 2 pieces of bacon and either a biscuit or hash browns - we got the biscuit and it was really good!) and the Mushroom Benny (comes with a large salad and the eggs were nice and runny). Portion-wise, we felt the EC Breakfast was on the small side, maybe especially the way it was presented on the plate, looked really sparse. Everything was good, just not quite enough of it. The benny was excellent though, loved the mushrooms and it&#39;s done on a thin biscuit which was so good. <br><br>Service started slow but after we placed our order, our wait for our drinks and then our meal was quick. Really enjoyed being on the patio and they have really pretty hanging baskets and planters!",
