"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/zJsPoqqMWbjIBIIl6F8b6Q/l.jpg",
"rating":"4.5",
"reviewcomment":"Is it even real sushi? I have my doubts. I hate sushi. It can&#39;t be good. What&#39;s the deal with this place? How did they get their hands on such bomb ass fish?<br><br>I ordered a la carte while my girlfriend and her mom ordered omakase. While I didn&#39;t get to try the whole sequence, I was thoroughly impressed by the unique variety of fish the chef prepared for them. Believe me, it&#39;s not just some hack serving you salmon and tamago, it&#39;s some fish I ain&#39;t even heard of before (and I used to work at a sushi restaurant)!<br><br>It ain&#39;t cheap though: I believe it was a minimum of $40 per person, but boy was it worth it. My girlfriend&#39;s mom was so happy with the food she told me it was the best meal she had in years.<br><br>As for myself, I ordered hamachi (yellowtail), tuna, and toro (tuna belly) ngiri. The tuna was sooo good. I thought they made a mistake and gave me all tuna belly. When I order yellowtail, I usually only order it for some variety so that I&#39;m not only eating tuna. However, their&#39;s here was just on another level.<br><br>This place has made me give sushi a second chance. It really is that outstanding. <br><br>My recommendation: skip the all you can eat and take your money here instead. You won&#39;t be disappointed.<br><br>100th review yay!",
