"rating":"3.0",
"reviewcomment":"I have been to Las Margaritas twice so in the last 3 months. Once for a Dine Out and the other just casually with a friend of mine.<br><br> For you drivers out there, there are plenty of parking spaces down 4th Ave as well as some free spaces in the neighborhood.<br><br>If you go here, you MUST get one of their margaritas, I love their strawberry margarita as it is quite fresh (Strawberry pieces in it) Â and has a slushy texture to it.<br><br>The food is very fresh and flavorful both times I ate here. My last visit I had the Enchiladas and my friend had the Baha Tacos. We both enjoyed our meals but the Baha Tacos were just &#34;ok.&#34; Â The Enchiladas were delicious and very filling as it comes with rice and beans as well. We had the jalapeno poppers as an appy and I do not recommend them.<br><br>The atmosphere of this place was very friendly and while we waited for our spot in line, we had a few drinks at the bar and the service was quick and friendly. My friend actually forgot her expensive jacket at the bar when we were seated and the bartender brought it over to us. Bonus points.<br><br>Now comes where I knocked down a star. The service. The restaurant gets very busy and orders may have been muddled up. What happened was we waited quite a long time for our food. We decided to order everything at once and we ordered margaritas, an appetizer, and our entrees. After about 15-20 minutes of waiting we asked where the food was and turns out there was an issue with the kitchen. Now here&#39;s the kicker, our food came out in reverse order which they should have been served. We got our entrees, then came the appetizer, and then our drinks!<br><br>I am a pretty easy going guy so I still left a good tip considering how good the food was and everyone working there seemed to be very welcoming and nice.",
