"rating":"4.0",
"reviewcomment":"CinCin does not disappoint!<br><br>I was asked to find a restaurant with available reservations by 7 pm on a friday evening (yikes!). I was pleasantly surprised to see an opening at CinCin.<br>The four of us set out not knowing what to expect --- two members of the group are &#39;paleo&#39; while my other half has to eat gluten-free out of necessity.<br><br>We arrived a little under dressed, but they didn&#39;t seem to mind and still treated us well. We started out with a few drinks at the bar; mine being one of the best old fashioned&#39;s I&#39;d had in a very long time. <br><br>We had the Carpaccio as a starter - perfectly tender and seasoned. I had the Halibut special (in season!) served with white bean puree, swiss chard, and magic. I have no idea how that piece of fish was so tender and juicy. My husband was well-informed about his gluten options and loved the Sea Bass with fingerling potatoes. Our paleo friends were happy with their perfectly cooked, tender, well seasoned venison loin and short ribs. We topped it off with chocolate mousse (beautiful presentation) and a good coffee.<br><br>This place is top notch: great service, good drinks, fantastic food etc... It is on the pricey side, but worth every penny.",
