"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/Fihg68Hk1ciAXOWsGjl41g/l.jpg",
"rating":"3.5",
"reviewcomment":"[Pull my noodle]<br><br>I&#39;ve been coming here over the last month or so to get my noodle fix. The noodles are prepared fresh each day in one of many ways - pulled, sliced, dragged, pushed, etc. It&#39;s made from the same dough and it really just dictates how the noodles look in the end. I found it really cool that they have the big glass window so you can watch the chef make them. The soup they come in is very tasty as well - a lot less salty than other noodle houses. Portion sizes are decent as well - a big eater would certainly be full. If not, I&#39;d recommend adding a side of pork&amp;chive dumplings. I quite enjoy them with malt vinegar.<br><br>Shaolin is located a block from the main hub that is Cambie and Broadway. It can get busy in there but I&#39;ve never had to wait for a table. There&#39;s street parking on Broadway and they also have a limited number of free spots in the back. The decor inside looks straight out of a 70s American movie - over the top tacky chinese decor but it almost seems they do it purposely. And it works. Service is just okay nothing to write home about.<br><br>All in all, great little noodle house worth a visit.",
