"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/qMqtkPgFNrvfYDQ4-rxc5g/l.jpg",
"rating":"4.0",
"reviewcomment":"Vancouver has a way of doing &#34;hipster&#34; right, with all the funky aesthetic and far less of the crap attitude. This place, on the surface looked a bit &#34;quirky for quirky&#39;s sake&#34;, but was actually really charming. The staff were super friendly and down-to-earth in that awesome way that only Canadians seem to have mastered, but by far the most amazing thing was the food. WOW. Each dish was even more incredible than the last, and the portions were hefty for tapas. The place is a bit spendy, but the quality is great and the entire dining experience was fantastic. The only complaint (from not just us but other tables) was that the music was a bit too loud for such a small space.<br><br>Note for Disabled: Reasonably accessible, but space is very small and Â crowded. Metered street parking or pay lot only.<br><br>* Know that if you have a Washington State disabled placard it will work for parking in disabled spaces in B.C., but unlike here you actually have to feed the parking meters if you park on the street (learned that one the hard way).*",
