"rating":"3.5",
"reviewcomment":"I would say that Lins is one of the better Chinese restaurants in Vancouver--great Chinese comfort food! I would recommend you to go for the lunch special. With the price set at 7.99 (before tax and tip), its definitely more worth it than doing dinner here. The lunch special comes with 1 soup, 1 main course and 1 rice. I usually get the mixed vegetable tofu while my partner gets the honey prawns, which is absolutely delicious (but you do get thirsty after awhile)! The chicken corn soup is also very tasty and its served quickly, assuaging your hunger. <br><br>Like many other reviewers have commented, the xiao long baos are phenomenal. The skin is not too thick and its very juicy. Its also pretty cool to watch some of the staff members work on making the xiao long baos at the counter. Â <br><br>If there&#39;s anything to be improved on, it would be the service offered... sometimes they may be a little abrasive (totally dependent on their mood) If they raise this standard, this place would be a solid 4-star restaurant with affordable offerings.",
