"reviewcomment":"LOVE this little piece of the Caribbean! We actually felt like we were on vacation ahha<br><br>We were here for a staff party last weekend and I have no complaints.<br><br>Food:<br><br>I&#39;m guessing my company opted for a snack menu - we tasted chicken and lamb skewers, calabash salad, little hors d&#39;oeuvres (roast chicken and roast beef I think), some little empanada looking things, and vegetable skewers. <br><br>Everything was incredible! Especially loved the salad and the skewers. so many flavours in one bite.<br><br>Drink:<br><br>they were serving rum punch in a fountain when I arrived but unfortunately I didn&#39;t get a chance to try it because it went so quickly! (people told me it was really good)<br><br>Music:<br><br>we had a house dj all night and it was such a good party! lots of variety in music choices and he even took requests which was nice! <br><br>Most importantly - SERVICE. All the bartenders were on point the whole night and the people who brought out the food and cleared used dishes were friendly and very attentive. <br><br>I will be going back for my birthday dinner for sure!",
