"reviewcomment":"We held our wedding here and felt they really delivered.<br><br>I have eaten here years ago and felt that the food was excellent, and service equally so, but not pushing the envelope in any way. Â The review below was specifically about our wedding experience.<br><br>The servers were fantastic, as was the woman that dealt with all of the wedding arrangements. Â No details was not covered (though I suspect we were low maintenance). They really went out of their way to make our 50 person party feel special. Â The &#34;fireplace room&#34; was perfect for a wedding, private yet we could feel the vibe of the place in the other parts. Â We had use of the patio which was also great as it was sunny.<br><br>You can opt for many custom meal packages and the standard cake cutting fees apply, plus there are options for microphones etc. Â The room itself hardly needs any decorations and is lined with nice windows on 2 sides.<br><br>The food was maybe a slight notch below the restaurant fare but that is a high standard to hit when you are talking 50 people and still fantastic (many of our guests really, really were enthusiastic about it and the service and told us so). Â I had the seafood medley form our set menu choices as did my new wife!<br><br>I highly recommend this place for your wedding, in part because the lighting helped the photographer quite a bit.",
