"reviewcomment":"Pretty happy with the price &amp; quality of the food here, at least at lunch.<br><br>Got here just after noon, and it was pretty empty, but filled up fast. Â We were greeted as soon as we stepped in, and had attentive service.<br><br>Our waitress was very good at her job, but a little pushy on the upselling. Two at our table just wanted the clam chowder bread bowl. Â Because they really love clam chowder and weren&#39;t hungry enough for anything else, and didn&#39;t want to share. Â Her- &#34;Did you want something else?&#34; Â &#34;No, thank you&#34; Â &#34;Why don&#39;t you share a couple of other things too?&#34; Â &#34;No, thank you, just the chowder.&#34; Â &#34;I think you girls should split the chowder then get a salad and something else to share.&#34; Â Like that.<br><br>Sorry our bill wasn&#39;t huge, but you turned our table fast enough, we got drinks, and we left wanting to come back to try other things. Â <br><br>That said, the food was really good. Â The chowder was creamy and delicious, and the shrimp poboy sandwich was really good too, with lots of shrimp and great fries on the side. Â <br><br>I&#39;d go back to try more things on the menu.",
