"rating":"4.5",
"reviewcomment":"Kishimoto is one of my fave Japanese restaurants in Vancouver and the only reason why I don&#39;t go more often is because it&#39;s so small and the lineups are so long unless you&#39;re there early or late. You can tell how busy they&#39;ve gotten by the big signs outside and inside the door explaining their wait system. Make sure you put your name down on the sheet as soon as you get there! We had a friend who went for dinner but the rest of his party wasn&#39;t there yet and it was his first time and so he stood there for 15mins without putting it down! <br><br>Hands down favourite menu items: Aburi Salmon (I think my absolute fave is still at Minami/Miku, but this is still delicious and I love the jalapeÃ±o on top to give it that extra kick!), Tuna Salad (very simple but refreshing and the tuna is delicious!) and the toro nigiri (last visit was the best melty piece I have had in a long time!). <br><br>Service is friendly and pretty quick and I really like the tea that they serve when you sit, I think it&#39;s a green tea and I&#39;m not sure what it is about it but it&#39;s really good! Last call is at about 9:45pm so if, like us, you&#39;re still waiting in line at 9:30, you can take a look at their menu and give them your order so it&#39;s ready to go by the time you are seated! Lots of free parking on the side streets too, just be careful of the narrow and no exit lanes.",
