"rating":"3.5",
"reviewcomment":"We were greeted one evening by a bitter cold winter evening in Vancouver. The nearby restaurants were packed and have no tables available. It were grateful for a hot bowl of pho at Joyeaux Cafe Vancouver on Howe Street. The service here is prompt and pretty friendly. I used to come here for lunch when I worked waterfront. It was always a treat. Vancouver downtown offers an abundance of ramen restaurants, but not many pho places.<br><br>Spicy Beef Noodles Bun bo Hue: I usually like to change my noodles to pho noodles. That&#39;st just how I prefer it. The spiciness, tart and salty lemongrass was delicious. Even for me, I didn&#39;t need to add extra chili oil. It was spicy on its own.<br><br>Lemongrass chicken with fried egg broken rice: The chicken was brine with flavorful lemongrass and spices. Served with pickled vegetables, some shredded pork. If you are tired of the same lemongrass chicken or pork, do give the lemongrass fish at Joyeaux Cafe a try. Not many places has this. It is lightly breaded, dusted with spices then deep fried.",
