"reviewcomment":"The Place:<br>From Commercial-Broadway station, this lively poutine bar is just a 10 minute walk North, along Commercial drive. My sister and I decided to do lunch here after she tried out their food a few days prior. <br>We ate here a little past 1:30pm, so there wasn&#39;t quite as many people, but the place was still busy. The resto had lots of seating with an outdoor option to enjoy the sun. The staff was very friendly and were happy to answer our questions. <br><br>The Food:<br>This resto is primarily a poutine bar but they do serve burgers, drinks and other things too. A nice treat was that their gravy is vegetarian and it was really smooth and tasty.<br>We ordered 2 things: the Chicken Kabob and the Beef Steak. The first had chicken skewers that I found were a bit overcooked and dry, so I&#39;d recommend something else. The beef though was very well cooked and went perfectly with the other well-seasoned toppings - mushrooms and some red peppers.",
