"rating":"3.0",
"reviewcomment":"&#34;One star for being unhygienic and having a ridiculous policy of not allowing Starbucks coffee inside their cafe. We got Starbucks specifically because of the bad reviews of Cafe Crepe&#39;s coffee. Â However that is not as bad as watching your crepe being folded and made by hand with NO GLOVES. What restaurant allows food prep like that in a world class city like Vancouver?&#34;<br><br>Just wanted to respond to this review and give a tip to all restaurant goers: policy or not, Â it is extremely rude to bring in your own food or drinks to a restaurant, especially when what you bring in is something that the restaurant offers. It&#39;s advertisement for the cafe&#39;s competitor inside their own establishment, and blatantly says that you will not be buying their product. Take a few minutes to finish your coffee/meal/whatever before you step into a restaurant. Â It is not a cafeteria where you can just come in and eat/drink whatever you brought with you, it&#39;s a business trying to make money. They do have a to-go window which you can make use of if you want to go elsewhere for coffee :)<br><br>Plus, most cooks use their bare hands to prepare food, unless it&#39;s raw poultry etc. While most kitchens are invisible to the customer, Cafe Crepe&#39;s is visible to the public.",
