"rating":"3.5",
"reviewcomment":"Great Coffee ESPECIALLY on a freezing day.<br>. <br>Once you walk in, you feel like it&#39;s a real coffee house. The smell of coffee being brewed, the small chatter among the guests, and newspapers hung on the wall for your reading enjoyment.<br><br>Vanilla Latte<br>One of the best in Vancouver. A little expensive, but very creamy and does the job on a freezing day. The size was definitely more generous than other coffee shops we&#39;ve visited, so don&#39;t be afraid to share!<br><br>Tuscan Ham Breakfast Sandwich ($4.75)<br>Pressed with the panini maker. Nice and hot when you get it. They also give you a nice portion of egg, and I DO LOVE MY EGGS! If you get this and a coffee, that should be a nice little breakfast.<br><br>Chicken and Brie Sandwich ($4.75)<br>Nice chunks of chicken. The cheese was melted. Great sandwich, but I do like the Tuscan Ham a little better. This is more of a lunch sandwich (FYI).<br><br>Chocolate Chip Cookie<br>A very big cookie (that I couldn&#39;t even finish in one sitting). Nice and soft. Not too sweet. I would for sure get this cookie again!<br><br>I&#39;d love to come here if I had some work to do. It&#39;s relaxing and pretty quiet, despite how many people are actually in there.",
