"rating":"3.5",
"reviewcomment":"Yum!<br>If you love jerk spice, you&#39;ll love the Reef.<br>I had a jerk gravy poutine, which sounded weird, but I really wanted to try it. I&#39;m glad I did because it was fantastic! It was a lot spicier than I had anticipated, but in a good way.<br>My brother had the tacos and said they were really good.<br>Before our food came they brought us a little basket of these fried dumpling things, almost like a cross between a donut and fry bread. Whatever it was, it was delicious.<br>I tried their signature cocktail for this month, a rum and ginger beer concoction called a Dark and Stormin&#39;. It was so tasty. I would have had a dozen of them if I wasn&#39;t on a budget (they were $7 each for a single).<br>The service wasn&#39;t great, but it wasn&#39;t bad, either. I think the male server was a little distracted by some pretty girls sitting at the bar, but that&#39;s cool. I get that. <br>All in all it was a pretty good experience, and I will definitely be back.",
