"rating":"3.5",
"reviewcomment":"Looking for a late lunch spot, my boyfriend and I ended up here.<br><br>We love the exposed brick walls and open airy space with a great bar and view of the kitchen. I got crab cake salad, and he got pulled pork grilled cheese sandwich with tomato and beef soup.<br><br>I love how the crab cake was crunchy and crusty on the outside and delicious with the accompanying aioli sauce. The sandwich was oozing with melted cheese and perfectly cooked and seasoned pork. The soup was quite flavourful and tasted like beef stew simmered for hours.<br><br>The staff were friendly and smiley, which is also a plus! I would have liked to try their brunch, but we got there a bit too late. :-( Perhaps next time!!",
