"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/3VBP1F6s09I3qxaMFhopgw/l.jpg",
"rating":"4.5",
"reviewcomment":"Our party of 4 thoroughly enjoyed Chef Adam Pegg&#39;s seven-course dinner served family style. Chef chooses the items--the &#34;chef&#39;s menu&#34;--based on our selection of red Italian wine, and then the food followed. Appropriate size portions.<br><br>Inventive dining experience and chance to sample many exceptional dishes.<br><br>Most memorable items were the Burrata Salad, Stinging Nettle Agnolotti (a stand-out dish similar to Handmade Ricotta Ravioli), Pappardelle with Lamb, and Pork Chop with Sausage and Peas.<br><br>Service was attentive...not too fast or slow on this Sunday evening.<br><br>Seating is tight (cozy?) with about dozen tables close together like a New York City restaurant. Would not suggest for a group larger than about six.<br><br>Dinner with taxes and wine was about $100 per person (not including tip)<br><br>Located in Kitsilano section on 4th at Alma. Dinner only. Closed Monday. Will open for lunch for private functions.<br><br>Tip: Â Book on an off-nite other than Friday or Saturday for best service experience.<br><br>See pics.",
