"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/MEkLTb_3Wt0JR5ufIxr7vA/l.jpg",
"rating":"3.0",
"reviewcomment":"I had dinner at The Reef during Dine Out Vancouver. <br><br>The menu selection was pretty good, though we limited ourselves to the Dine Out menu. The overall taste of the dishes we had was about average for a Caribbean restaurant. My curry was OK, but I thought the cole slaw part of the meal was pretty gross. His jerk chicken was really good though. Another reviewer said it was really really spicy which we did not find to be the case at all. My curry was spicier, so maybe they are just not used to spice? Or maybe there was a different cook in the kitchen that night. We had the fried plantains and the mac and cheese balls to start and both were really good. The sauce that comes with the plantains was amazing though. We ordered extra, and I&#39;ve been trying to figure out the recipe for it ever since. <br><br>Probably the best part of our dinner were the drinks. The bar tender made pretty amazing mixed drinks, and even put something together for us that wasn&#39;t on the menu. <br><br>The wait staff seemed quite attentive, and my only complaint with the restaurant would be that the music was so loud we had to yell, so it wasn&#39;t the intimate evening we had planned.<br><br>I have a feeling I&#39;ll be visiting The Reef again in the near future.",
