"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/UwcYpwrXpYtHbX7LCkXgAg/l.jpg",
"rating":"4.0",
"reviewcomment":"One of my new favourite restaurants... I could literally rave all day about this place. The ambiance is so inviting and welcoming, and the service is great. <br>On a Saturday night, the place is packed, so make sure you make a reservation. We started the night with a beet salad, a tomato salad and the goat cheese, arugula and goat cheese tart. The salads were good, but the tart was to DIE for. It was the perfect balance of crunch from the pastry, salt from the goat cheese, and bitterness from the arugula. Definitely a must have. For a main, I had the Red Snapper (on the changing menu). It was well seasoned with a beautiful lemon butter sauce. However what really took the cake was their Chocolate Mousse. I swear it was the best mousse I&#39;ve ever eaten. Not too sweet, not too bitter, and perfectly fluffy. <br>Safe to say La Cigale is one of the best restaurants in Vancouver; it takes you right back to France. Highly recommended!",
