"rating":"4.0",
"reviewcomment":"I&#39;m not normally a fan of eggs Benedict but after looking at the photos from the Cafe Zen Yelp page, I decided to give bennys another shot! Â Maybe the one I had initially tried at De Dutch was just a miss (which, it probably was). Â I arrived at 9:40am, just in time for the morning special. The morning special came with 2 peices of buttered toast, 2 eggs (any style), bacon/sausage/or ham, and hash browns. Â Refills with my coffee were free as well! Â I was pleasantly surprised that the coffee was actually quite good, since coffee at most &#34;diner&#34; type places tend to be a disappointment. Â Also, I liked how our server came back frequently to make sure our cups were topped up :) Â 5 stars for service in my opinion. Â She was very pleasant and friendly!<br><br>I was fully impressed by my chorizo benny that came with a side of grilled tomato. Â However, when my bill came, I noticed that a half order was $7.99 and a full order was $10.50... only a $3 difference which I thought was a little bit of a rip, so if I ever come back here I&#39;d order just the full order of bennys and nothing else. Â I noticed that near-by customers were ordering mix-matched bennys. Â This is great cuz I always love to have more of a variety to try!<br><br>Overall, it&#39;s a cute place and it since it got pretty busy I can tell it&#39;s a popular spot. Â I&#39;m not sure if I would come all the way to Kerrisdale again from my neighborhood but in case I&#39;m in the area I wouldn&#39;t mind ordering the eggs Benedict again!",
