"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/UJj92vFOYlU0_A_17gejDA/l.jpg",
"rating":"3.5",
"reviewcomment":"Right in downtown Vancouver, this Thai spot hits the spot! Not too far from the action, it is easy to find as you stroll around the shops on Robson St. <br><br>You will be led upstairs where, if you&#39;re lucky, you&#39;d be seated by the window-- perfect for people watching below and also for watching parking attempts by super cars with Ns.<br><br>Energy was lively for a Friday night, with a steady flow of people coming in and out, proving that quite a few people were also craving Thai. <br><br>The servers were friendly, prompt and helpful. Filled our water, didn&#39;t linger and served amazing food.<br><br>Ordered the rendang bed and pineapple rice. Rendang beef was good for two people, portions were a bit small. The meat was so tasty that you&#39;d savour each bite and feel thankful for them getting it right.<br><br>Pineapple rice was flavourful, no wonder it is a crowd favourite! Rice was served in a pineapple. They were able to accommodate my request to remove ham (food preferences); this didn&#39;t sacrifice the flavour. <br><br>Got the lovers bowl for the Bahia drink (like a piÃ±a colada) and it was a refreshing, cool drink that complemented the delicious entrees. <br><br>Overall, a solid restaurant choice in downtown Vancouver for a budget eater. Â I would return and recommend to tourists and locals alike.",
