"reviewcomment":"If you&#39;re looking for a real good Indian meal on Davie, this is a great spot to munch at. The taste, presentation and vibe are here, but the service is straaaange. We were served by the owner, but he didn&#39;t really...uh...try at all. <br><br>Spice levels are perfect, veggies are all delicious, naan was great too, but I felt like I shouldn&#39;t have been in there. We had plenty of food to take home with us, and it tasted just as great a few hours later. I felt like saying, &#34;hey man, I&#39;m going to review this for the Elite Yelp scene,&#34; but in my head I fast-forwarded to a response which I imagined to be along the same vibe that was already being dished out. Maybe he was having an off day, but he seemed kinda dazed and not really in the mood to deal with humans. <br><br>Clearly this place is a winning taste sensation, but I&#39;ll do take-out next time despite a decent interior and feeling.",
