"categorystrlist":"Japanese,         Sushi Bars",
"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/GR_VWMDwTeuELTRUNvek4Q/l.jpg",
"rating":"3.0",
"reviewcomment":"I&#39;ve been to Toyama about 3 times so far, each time for some late night AYCE. I would say that there&#39;s good value for your money here if you&#39;re measuring the quality of the food. They don&#39;t skimp on their ingredients, their sushi and sashimi slices are a decent size. The one menu item that absolutely made me fall in love with Toyama, though, is their oyster motoyaki! YUM! I would highly recommend it to anyone!<br><br>I&#39;d say that on the average, Toyama has pretty good service, but that&#39;s actually also the only thing that kept me from giving them a full 5-star rating. I think that by now, they should more or less be able to anticipate what times their restaurant peaks and gets crazy busy, and they should have ready personnel to meet the demands of those times. Their service tends to slip into &#34;poor&#34; category when it gets busy and I&#39;ve seen more than just a few customers get huffy because they get neglected (i.e. orders don&#39;t get taken, orders take forever to come out of the kitchen, etc.)<br><br>But really, their food is more than enough reason for me to keep coming back!",
