"rating":"3.5",
"reviewcomment":"Love the value of the entrees here. Â Most kebab dishes are under $10. Â I usually pay an extra $1 for salad and rice. Â Food quality is great for the price. Â <br><br>This time we ordered kashkeh bademjoon. Â It is a deep fried eggplant spread. I could taste the mint but cannot make out the rest of the spices. Â I found it went well with the pita. Â It was quite interesting to try as I am not familiar with Persian food.<br><br>We got tahdeeg as a free appetizer. Â Crispy rice served with bits of beef. Â This version is better than the one we tried at AVA Restaurant. Â There was more sauce to go with the rice hence it was less dry. Â I know there are different versions but I like sauce :)!<br><br>The kebabs are moist and flavourful. Â I think the quality of the meat is good for the price. Â Salad was fresh. Â Rice was alright.<br><br>The service was only okay. Â It seems like asking for water always require staff to be asked multiple times. Â This seems to be a trend with Persian restaurants I have visited. Â Service is minimal.<br><br>I am giving 4 stars for the value and free appetizer. Â Last time I was here we did not get the tahdeeg on the house. Â Seems like the competition in the area is getting tough and this is the second restaurant we got this for free. Â AVA Restaurant also served this as a free appetizer with along with some pita.",
