"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/-sJnkumWKbzILR0yLHjxTw/l.jpg",
"rating":"3.5",
"reviewcomment":"Trendy, dim lighting, sort of upscale-ish Japanese fusion spot. Â Checked this place out for happy hour - excellent quality food for under $5 per platter. Â I&#39;m a bit impressed as $5 happy hour appetizers in the Bay Area will only get you a plate of garlic fries. Â The portions are smaller here, but you&#39;re getting quality food at an upscale place. Â <br><br>We tried the hot wings, gyoza, ebi mayo (tempura prawns), dynamite roll, kinoka (rice in stone pot), and beef tataki. Â Total we had about 8 platters to share between 5 people - we could have ordered more, but decided not to. Â If your party is hungry or consists of big eaters, I would recommend ordering 2 or 3 plates per person. Â <br><br>We also picked up a large sized cold sake ($27) - interestingly was served in a frozen bamboo jug. Â More of novelty - a glass bottle would have made it easier to pour though. Once you&#39;re tipsy....I would imagine people would be spilling sake all over the table since you have no idea when the sake is coming out. Â Where&#39;s the see through bamboo jug? Â <br><br>Most of the appetizers were pretty good - hot wings, ebi mayo (prawns), kinoka (rice in stone pot), and beef tataki. Â The gyoza and dynamite roll were decent as well, but didn&#39;t knock my socks off; however, I would still order these again. Â <br><br>I&#39;d come back here again for happy hour.",
