"rating":"3.0",
"reviewcomment":"I ate here on the 18th of March 2014 and enjoyed it enough to give it 4 stars. This restaurant has good food and is a cafeteria/bistro style restaurant. <br><br>Pros:<br>Large portions<br>Gluten Free<br>Lots of Extras<br>Reasonable Prices<br>Beautiful presentation<br><br>Cons:<br>Canned Shrimp (for salad wraps)<br>Spice grade is misleading and increased hotness just means more chili flakes, which are not a very flavorful spice<br><br>We ordered the Jungle Curry, Szechuan (spelled that right first try!) with Cashews, and lettuce wraps. I applaud their use of iceberg (which gets an unfairly negative rep in my humble opinion) for the wraps, because the leaves have a shape like little bowls and are very easy to load up. <br><br>I couldn&#39;t finish my noodles, but my companion finished his Jungle Curry, which he seemed to really, really enjoy.<br><br>I would absolutely go back to try different things. The staff don&#39;t interact with customers too frequently (apart from order taking and food delivery for eat-in customers) but everyone I spoke to was lovely and had clean fingernails, which I prize in food servers.<br><br>If you&#39;re ever by the main Vancouver Public Library you should take a walk down homer and give this place a try.",
