"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/5odFszbu9UGga2x-3OMLOw/l.jpg",
"rating":"4.0",
"reviewcomment":"This eclectic French bistro located in a slightly iffy part of town is worth the trip! <br>Remember Michael (from Moustache Cafe), he&#39;s front-of-house here and is running this dining room with the precision of an operating theatre (I mean that in the best possible way.) Getting folks in and out of this busy and small restaurant can&#39;t be easy and watching Michael is like watching a slightly mystical ballet unfold. <br><br>My date and I both had the Table d&#39;hote. I believe it was $29 for 3 courses. We ate like royalty. Never have I Â &#39;finished&#39; as much food as I did at Jules. We both had the steak and frites, and mine was served with Peppercorn sauce, which I loved! Â Ate all of it! My salad was great and my date&#39;s soup was perfect. <br><br>And you needn&#39;t have the chocolate terrine for desert as listed. I had a desert called &#34;Oranges&#34; which led me to tip the plate of syrup into my mouth at the end of it. (I had no shame.) And I then proceeded to eat the rest of my date&#39;s desert, which I think was grilled pineapple. These were the best deserts I&#39;ve ever eaten. <br><br>We had a charming French waitress who was very good and there is also a knockout redhead behind the bar (gotta give a shout out to all redheads) who also brought plates out to diners, keeping things moving. <br><br>This is a dance I am happy to repeat.",
