"rating":"4.0",
"reviewcomment":"Saigon Sour (apple juice, chamomile syrup, lime, gomme, ginger, lemongrass, thai basil, kaffir lime leaf, cilantro, red chili pepper, fresh lime, egg white, fresh apple) $5 4/5 - not overly sweet. Â Too bad it was 1/2 filled with ice. Â I picked this because a lot of their drinks have ginger in them.<br>Hawker Thai Chicken Wings (sweet &amp; spicy nahm jim glaze) $13 4.5/5 - It was about a pound. Â Crispy skin with flavourful glaze. Â The flavour reminds me of honey glazed BBQ. Â Some pieces with chili on top can be a bit spicier. Â Some people tried to compare them to Phnom Penh&#39;s but I think they are totally different things.<br>Cha Ca Hanoi (ling cod, market greens, turmeric chili coconut milk, dill, rice vermicelli, nuoc cham, fresh herbs, scallions) $15 3/5 - the rice vermicelli was too mushy. Â Very strong taste of coconut milk but Â a little bit too bland. The lingcod was not that fresh.<br>Indonesian Peanut Noodles (shiitake mushrooms, charred eggplant, spinach, bean sprouts, egg noodles, sambal ginger peanut sauce) 3.5/5 $14 - I didn&#39;t enjoy this as much as my friend did. Â I found their noodles were a bit overcooked too.<br>Nasi Goreng (classic Indonesian stirfried rice, chicken, shrimp, tomatoes, sweet onions, peas, fried egg) $15 4/5 - very big portion and I took 1/2 of it home. Â Very flavourful. Â The rice was on the wet side. Â Too bad they put too much salt on my fried egg. <br>Chai Chocolate Pot, milk chocolate, candy crumbs $8 3/5 - strong chai flavour. Â A little thicker than I want. <br>Coconut Panna Cotta, pineapple salsa, shaved ice $7 3.5/5 - reminds me of the yellow split pea coconut pudding.<br><br>They only have benches but no chairs. Â It might be a problem for some people. Â We had to wait a bit for our mains to come after our wings. Â The starch were a little too soft for me but flavours were good. Â I would visit more often if it opens for lunch (at least on weekends).",
