"categorystrlist":"Wine Bars,         Italian,         Cafes",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/8kkardAqntRyOVgZ3Mo4_A/l.jpg",
"rating":"4.0",
"reviewcomment":"Stopped by for a long overdue visit to the bar Friday night. <br>Had a most excellent cocktail involving rum and cherries... enough said! <br>It is so easy to tell the difference between highly skilled mix-ologists and just plain ol bar keeps with that first balanced sip. Never too boozy or sweet with just the right amount of umph. I also know because I have a sudden urge to keep on drinking. Like. All night. Work at 7am the next morning. Who cares. Mmmmmm.<br>Thankfully I resisted temptation and probably saved my job in the process and we departed like two old ninnies.<br>The lovely Lauren sent us off into the rainy/snowy night with some of their homemade Limoncello. Ohhhh sooooooo tasty!<br><br>It was mucho lame of us to bail just as the band was set to play their first note. We shall return very soon for a proper night in!",
