"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/p_8pAnonJaaWgtYVar4YxA/l.jpg",
"rating":"4.5",
"reviewcomment":"Kaide&#39;s all about the quality. Super fresh fish at a great price. There are a lot of choices for sushi in this city, and the hall mark of any of them should be the quality and fresh-ness of the fish. Kaide hit&#39;s it spot on. Gloriously fresh, melt in your mouth cuts. Delicate, and flavourful. Personally I opted to go Omakase, and I&#39;d recommend it to anyone visiting Kaide. <br><br>Kaide also produces a classic set of rolls, along with some house and regional specialities. Kaide provides all of this is a simple, small, yet classy. atmosphere. Mix in friendly wait staff, and great chefs and you&#39;ve got the winning combination to be a five star sushi joint in Vancouver. <br><br>Of course the last hallmark of greatness is consistency, and time and time again Kaide has delivered it with much flare. It&#39;s probably better to get there during the week or earlier on Fridays, the size leads to crowd.",
