"rating":"3.5",
"reviewcomment":"This is a place the average person hates. Hell, I hate a place like cactus club in most cities (LA, Miami, Dallas). It had that initial vibe of exuberant, power douche lounge bar. Â But the vibe changed as we drank. Honestly, it became a fantastic place to drink for a few reasons.<br><br>An obvious reason is the beauty of the hostesses. Yes, I sound like an ass pointing that out but it&#39;s true. Deep down it&#39;s something a male traveler can admire, I hate to admit. Â Also they were friendly so it&#39;s not all vanity. We were attended to as we needed something and with friendliness. <br><br>Another reason is the drinks are well made. I&#39;d never heard of a caesar cocktail in my life. I&#39;m from Texas. They don&#39;t exist. It&#39;s like an alternative to a Bloody Mary or the Canadian michelada. It had a skewer with pepper, mozzarella, olive, and some sort if amazing pickled onion. I thought it was great. That kiwi laden cocktail was awesome, too. <br><br>Lastly and simply, it&#39;s a stop in yaletown. You don&#39;t want to go to yaletown and not barhop and you don&#39;t initially want to be hammered and fist pumping. You want to start at a place you can chat with a group until tipsy enough to rage elsewhere. Here you can get that early buzz and then harbor it elsewhere. And specials are pretty good.",
