"reviewcomment":"What can I say? I was having one of those days, &#34;Me WANT Pad Thai, NOW!&#34;<br><br>My boyfriend and I decided to try this place because of the good reviews and it being one of the only places open early afternoon on a Sunday.<br><br>As soon has we walked in we were greeted with a bow from our server/host. He was the most friendliest server in the world. He gave us our menus, and we contemplated on our drinks. Our server could tell that I was having a hard time deciding so he offered a taste sample of the plum juice. It was way to sweet for me so we decided to order the thai iced tea. The iced tea was SOOO delicious. I was very unenthused when my boyfriend ordered the ice tea because I know how sweet the ones in the grocery store are. These ones however, tasted like they were prepared from real tea, cooled, and only slightly sweetened. It looked like Â a tad of coconut cream was added at the bottom of the glass, which added a nice kick!<br><br>We started our meal with an order of chicken/pork satays. The chicken satay was the best I have ever had, so juicy! The pork was good, but nothing special.<br><br>For the entrees, we Â ordered the pad thai (of course), and the duck curry. The pad thai was fantastic, the best I have ever had in a restaurant; it satisfied my cravings completely. The combination of spicey, sweet, sour, and salty was bang on. The duck curry had huge chunk of lychee and pineapple. The sauce was not overly sweet. The flavour of the lychee and the pineapple complimented the duck and the red curry paste wonderfully!<br><br>We were too full for dessert by the end, but they all looked very delicious! A tad too expensive, however...<br><br>This place was awesome :&#39;) I am so happy I came here today. My tummy was happy all day long.",
