"reviewcomment":"We were walking around in Gastown on Saturday, trying to find a place for dinner. Â We came upon Incendio, and were intrigued by the &#34;Italian soul food&#34; slogan on their sign. Â We approached the front door, wanting to check out the menu. Â The driver waiting outside told us the food is great, so we got a table. Â I guess it was still early enough in the evening that we got a table right away.<br><br>The inside of the restaurant is nicely lit without being too bright or too dark. Â And the surrounding is clean and orderly. Â We were helped right away by our server. Â We ordered the antipasto plate, a 12&#34; Gastown pizza, and the cioppino. Â The antipasto plate was loaded with so much goodies. Â And the Gastown pizza was fragrant and the gorgonzola cheese was just perfectly melted and gooey. Â I really enjoyed the cioppino the most, as I love seafood. Â The seafood was abundant, and the flavoring was on-point, not too salty and overwhelming.<br><br>We enjoyed the great service, ambience and food. Â And we will definitely recommend this restaurant and come back for more treats.",
