"reviewcomment":"On a rather cold Tuesday night a friend and I decided to go check out a cheap movie and were hungry so this place next next door to the theatre was the best option.<br><br>This neighbourhood as it is called downtown, which means lots of chains and some pricy french joints. <br><br>The decor is modern and the presence of a wood burning oven was a good sign as you walk in. The ambience is similar to a Boston Pizza, maybe because they use the same colour scheme. <br><br>Our server was very friendly and sat us upstairs on the balcony which gave us a good view of the bar. The service was very fast and good.<br><br>We started off with a ceasar salad, with ample amounts of fresh parmesan grated at the table. We shared one of the signature pizzas&#39;s, Sicilian, full of olives and vegetables and a good amount of meaty parts, pepperoni and something else not very memorable.<br><br>I gave this place four stars as the food is healthy, delicious and the service is very fast and pleasant.",
