"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/V_OvcSIuDUxtkQ-h2ZLiRg/l.jpg",
"rating":"3.5",
"reviewcomment":"I just finished having brunch here with my food group here on New Year&#39;s Day. I had read some of the negative reviews before coming here about the brunch buffet and was skeptical. I was proven wrong. Â The only thing I can say is that those people who wrote bad reviews wouldn&#39;t know a good thing if it hit them in the head. This brunch buffet is the best. To the one reviewer who said eating here was like setting two $20 bills on fire, I have no idea where this lady usually eats..... maybe Buckingham Palace but the food, service and ambiance here were EXCEPTIONAL. Oru loves breakfast!<br><br>Buffet brunch consists of in house made meats such as bacon, ham two kinds of sausages,(oh my so good!) salmon done two ways. They will make eggs any way you like including bennies with salmon or crab. There are cocoanut pancakes, homemade chocolate waffles, brioche French toast, hash with chorizo, great pastries, a large selection of cheeses, bowls of Chantilly cream Â and lots of fruit, homemade donuts brought to your table, yogurt parfaits, fish tacos, chile taquitos, (haven&#39;t had that for breakfast since travelling in MÃ©xico) lox and bagels...the list goes on. Service was exceptional refiling coffee and tea every minute, bringing fresh squeezed juice to the table. The manager personally walking around to make sure everyone had what they needed. <br><br>I think the previous reviewers who wrote that staff here were rude were making it up. There was even a make your own Ceasar bar and the first shot was on the house. One person at out table actually got enough free vodka to the equivalent to 4 shots. At $33 this buffet is a steal for the quality of food you get. They use the best ingredients i.e bottles of Noble maple syrup, bowls of Chantilly cream, Neufchatel cheese. I am always skeptical at buffets but this is the real deal which Is why I was so confused by the negative responses. Staff were friendly, accommodating and courteous. Its hard to find good service in Vancouver where the norm is the &#34;hipster I don&#39;t care that you in my establishment attitude&#34; prevails. Oru does not disappoint.",
