"rating":"3.5",
"reviewcomment":"Ducked in here for snacks before a Yelp event recently...as soon as I saw the interior, I knew we were in for something special!<br><br>Most of the restaurant has typical tables but at this Main St. location, there was a wall of tiny wooden booths that one could tuck into as well. Since we didn&#39;t have reservations and we were just a party of two, we had the treat of being seated in one of these booths.<br><br>Everything we ordered was super tasty: ebi mayo, duck breast, chicken, beef (sorry, I don&#39;t recall which one). Strangely though, the stand out dish were the yakioni, or grilled rice balls with butter shoyu. <br><br>As this was a snack excursion, I can&#39;t comment on many of the menu items but I feel assured that you can&#39;t go wrong no matter what is selected. I would definitely order the duck breast and rice balls again but I&#39;d also explore the grill and oden menu more fully. I think this place would be fun whether it&#39;s just two of you or a big party.",
