"rating":"3.5",
"reviewcomment":"I had no idea that there was a Romer&#39;s on this side of Vancouver. I&#39;ve been to the location in Kits a number of times and have always enjoyed my burgers so I was pretty excited to check out one that is closer to home. <br><br>I ordered the magic mushroom burger which was tasty. It wasn&#39;t full of mushroom goodness - they could have piled on more mushrooms - but I liked the addition of the herb garlic Boursin. We ordered a sharable plate of their fries with two dipping sauces: truffle aioli, which was fantastic and I&#39;d order it again, and a bacon mayo, which was a bit strange. It had weird chunks of stuff in it. It seemed like they were going after a baked potato flavour and it definitely paled in comparison to the truffle aioli. I had one of their $5 Caesars as well which was tasty. I&#39;m not a big Caesar fan, but I finished all of mine. <br><br>Service was good. Fairly prompt and there was no pressure to leave when we were done. On a nice day, I can see it being great to sit out on the patio and enjoy the sun and river view. I&#39;ll definitely be back - especially since it&#39;s so much closer to me compared to the other locations.",
