"rating":"4.0",
"reviewcomment":"My friend heard lots of good things about this place so we decided to give it a try for lunch.<br><br>The restaurant is located inside a strip mall on Kingsway but there were plenty of parking in front.<br><br>The place is spacious and clean, and have a nice rotation of customers in and out without being too crowded.<br><br>They have the typical pho but we decided to try different dishes. People around us ordered the Pho and from all the happy slurping noises, they sound very happy with their lunch.<br><br>We chose: as we are trying to cut down out carbs..<br><br>Iced Vietnamese coffee<br>Iced plum with Soda - tangy and sweet, very refreshing<br><br>Vietnamese Crepe - this thing is ginormous with lots of lettuce to make the wrap, tons of Thai Basil and mint, cucumber and pickled daikon and carrots and the biggest crepe filled with big prawns, meat and sprouts. This is listed in the appetizer and it&#39;s a meal size item. Â <br>Everything is so fresh and tasty, I was half full already after making one wrap.<br><br>#42 pork skewers with shrimp wrapped sugar cane over light vermicelli sheets, also comes with tons of greens. <br><br>Very healthy to wrap everything inside the large lettuce leaf. <br><br>The servers are very friendly and nice and constantly come by to refill your water or tea glass.<br><br>We will definitely return again.",
