"categorystrlist":"Sushi Bars",
"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/1n8H_w7Ro9n-MMu1aX9B2A/l.jpg",
"rating":"3.0",
"reviewcomment":"Everytime I go to Vancouver, this is one of my must-go places!! You don&#39;t really get this kind of quality Japanese food for this price anywhere in LA. I wouldn&#39;t say it&#39;s the best quality, but it&#39;s so worth it. The tastes are great, the portions are big, and the prices are even better! Probably one of the best Korean owned sushi restaurants I had. <br><br>This is the 3rd time I&#39;ve been here and u just can&#39;t get enough of it! Love their red dragon roll. It has tempura shrimp, avocado, chopped scallops, masago, lettuce, wrapped in salmon and diff types of salmons roe on top. So good! Their boxes and combos are also good and great value. You get 10 pcs of huge ass sashimi, 5 nigiri, salad, rice with masago and seaweed, tempura! All those for $15..so cheap! Also tried the chopped scallop roll (all julienne strips of cucumber in the roll and real chopped scallops on top, not nasty bay scallop and California roll).<br><br>For salmon and tuna lovers, it&#39;s great if you order the special A which includes 2 pcs of nigiri, 6 pcs of sashimi, 4 California rolls, rice, soup and salad for $7.50. That&#39;s cheaper than ordering sashimi and nigiri alone. When I get a chance to starve myself next time, I want to order the chicken Katsu as well that is served on a skillet with veggies. <br><br>I noticed that they have a few more locations now, hopefully it&#39;ll still be good and prices doesn&#39;t tremendously high next time I visit there.",
