"rating":"3.5",
"reviewcomment":"Stopped in around 2ish on a Friday for a late, light lunch before an evening event. Â As an out of towner the proximity to my hotel was the main draw here but I was pleasantly surprised!<br><br>The place was pretty empty, plenty of tables available, but being on my own I just grabbed a seat at the bar. Â The service was super friendly and attentive. Â My waitress rattled off the specials and when I asked for her recs she was a wealth of information. Â The decor was typical gastro pub, but I did enjoy the pop art-esque portrait of Don Cherry on the wall.<br><br>Downgrade a star for being out of my first choice, oysters on the half shell. Â My waitress explained an issue with the supplier and how they&#39;d have them tomorrow, but that doesn&#39;t really help me now does it haha. Â Oh well. Â My substitute, the carpaccio, was amazing! Â Melt in your mouth tenderloin with great quality olive oil and these really unique balsamic &#34;orbs&#34;. Â I&#39;m assuming they were flash frozen a la Dip&#39;n Dots and then thawed. Â It was an unexpected neat touch :)<br><br>Didn&#39;t try anything else off the menu but I&#39;d definitely be back if I actually lived here!",
