"rating":"3.5",
"reviewcomment":"If you&#39;re looking for Taiwanese food and bubble tea Beefy Beef is a pretty safe bet. One of the most popular items on the menu is the Salty Peppery Chicken Nuggets with noodle in soup and it certainly hits the spot. The nuggets are indeed salty, but that&#39;s what the plain noodles in a clear broth are for. <br><br>Service is average for a place like this, they won&#39;t go out of their way to give good service, but they&#39;ll respond to your requests. They sometimes even clear your plates before you leave! <br><br>Cleanliness is again standard for a Chinese restaurant: looks clean at the front of the house, doesn&#39;t look so clean when you head to the restroom. <br><br>Parking fills up out front quite frequently so look on the street along Main or in the parking lot of the bank next door if it&#39;s after bank hours. <br><br>A nice special they have is a free appetizer if you order 4 beers. Beer at a bbt joint you say? Why not? Beer is good anywhere, anytime!",
