"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/0b6uEme5Xvh7syPMta_V-w/l.jpg",
"rating":"3.5",
"reviewcomment":"Two Parrots. What can I say? Two Parrots. They have two Parrots on the sign. It&#39;s called Two Parrots. I wonder what came first- the name, or the sign? It&#39;s interesting to think about. But forgive me, I haven&#39;t come on Yelp to discuss signs and names, although Two Parrots does indeed have both a sign AND a name. The name, as I&#39;ve said, is Two Parrots.<br><br>The food tastes like food. The beer tastes like beer. The tables taste like tables. As far as bars go, this is one. As far as places to eat go, this is one. And as far as places with fairly attractive waitresses go, this might be one, depending on your waitress. <br><br>Would I eat here? I already have. Would I eat here again? I already have. And will I be eating here in the future? I can&#39;t see the future. I might be dead, or worse, so who knows. Only God knows if I&#39;ll be back at Two Parrots. <br><br>Two parrots. It&#39;s as delicious as Two Parrots Perch &amp; Grill.",
