"rating":"3.5",
"reviewcomment":"Urban fare reminds me of a super market I would see in a film or TV show and wonder why it didn&#39;t exist in my neighbourhood. This location is a stone&#39;s throw away from my workplace, and that will have to do.<br><br>I like to come here every so often and stock up on items I need for work: avocados, greens, tuna, and little packets of almond butter. I didn&#39;t even know they sold individual packets of almond butter until I bought them here.<br><br>Pros: <br>- Excellent location<br>- Organic produce/packaged goods<br>- excellent quality of fresh ingredients.<br>- they sell my fave granola<br>- good business hours<br>- friendly, chipper, staff<br><br>Cons:<br>- Can be very expensive (9$ for a can of wild tuna?!)<br>- layout is a little confusing as there are small <br>- limited stock due to small location<br>- sometimes hard to find a mobile staff member<br>- limited space, so it is a little cramped.<br><br>I love their buffet style take away food as well. They make some pretty awesome roast/rotisserie chicken and their steamed veggies are always firm and vibrant. I would highly recommend this location if you&#39;re in the area and don&#39;t know what to do for lunch.",
