"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/wDIdM-HvVOFkVk7gcFWKLw/l.jpg",
"rating":"3.5",
"reviewcomment":"This was my first visit to Honjin and overall, I&#39;m impressed. I ordered their lunch special bento box with chicken teriyaki, and subbed their dynamite roll for the maki roll. The price was reasonable for a lunch box (although higher than some), and the wait was a little excessive, but they were busy, and I didn&#39;t call ahead to order my takeout so that was okay too. <br><br>The best part of the meal was by far the teriyaki. The sauce is incredible - sweet and thickened with honey or molasses with the perfect amount of ginger and garlic. Probably the best teriyaki I&#39;ve ever had. I wouldn&#39;t say it&#39;s necessarily traditional, but I am definitely a fan. Everything else was solid, but not great. <br><br>I would definitely go back and just order the teriyaki, and skip the rest of the box.",
