"rating":"3.5",
"reviewcomment":"Comfort food. No, it&#39;s nothing spectacular, but they serve up very good burgers with all you can eat fries (even tho by the time I&#39;m done with the burger, I never even finish the first round of fries). There&#39;s a decent sized beer menu and full bar cocktail menu, if memory serves.<br><br>Every time I&#39;ve been here, the service has been great. Staff are super friendly, even at the busiest times. Speaking of busy, it can get really noisy inside. <br><br>One thing I experienced that I thought was weird is that sometimes, that handheld credit card machine displays in french and there&#39;s no way to change it. Sorry. I don&#39;t speak/read french. Oddly enough, when I switched to a different card, the display was in English. Quirky.<br><br>I do kinda hate that it&#39;s upstairs, only because when it&#39;s raining (as if often does in Vancouver) I always feel like I&#39;m going to slip on the stairs. And, yeah, the elevator smells bad. Thankfully, it&#39;s a quick ride.",
