"reviewcomment":"I have bookmarked Octopus Garden for a long time, I finally visited it! It&#39;s located on Cornwall Ave and is small cozy Japanese restaurant. I liked the dÃ©cor and staffs were so friendly. They charged for tea but it served with nice tea set. Â <br><br>We were so hungry and ordered quite a lot of foods! Â <br><br>Agedashi tofu in spicy mushroom sauce - Tofu wasn&#39;t smooth and mushroom sauce wasn&#39;t favorable. <br><br>Assorted sashimi - Hamachi, Sockeye salmon, Ika, Tako, Waru, Nishin (Herring) and Mekjiki Toro (swordfish) All the sashimi were delightful and fresh! Especially Nishin and mekjiki toro so delicious! <br><br>Nigiri - Hamachi Toro, Ika, Tuna O-Toro, it&#39;s not too fatty but mouthful.<br><br>Wagyu beef roll - high quality grade of wagyu and strong taste of beef, yummy.<br><br>Lobster roll - It&#39;s good, nothing special.<br><br>Spicy chopped scallop cone - never had that spicy scallop cone. Â I loved the crispy and spicy! <br><br>Mirugai nigiri - Very fresh geoduck sushi, thumbs up!<br><br>Dragon roll - Beautiful presentation and lovely eel roll I never had.<br><br>Black sesame ice cream and banana tempura with ice cream - Just saved room for dessert. Â Strong black sesame flavor and huge portion of banana tempura. Â I died for it.....<br><br>I definitely will be back!",
