"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/OA_YHeaszD3L0OrcB-h8CQ/l.jpg",
"rating":"2.5",
"reviewcomment":"[Post-Party Poutine]<br><br>After an evening at the Roxy, I needed food to fill the giant alcohol-filled pit that was my stomach. I stumbled into Smoke&#39;s Poutinerie purely out of convenience than a tactical Yelp-certified mission. Short story: The poutine is just mediocre. <br><br>My bacon cheeseburger poutine came in a cardboard to-go container and was the size of a softball. The cheese curds were pretty solid and waxy but the bacon, gravy, and cheez whiz drizzle were hot and tasty. The underlying fries were crispy and fresh. Considering the fact I was partially drunk and completely starving, this meal didn&#39;t taste as good as I expected. The beer goggles were definitely on (for food that is) and I wasn&#39;t overly impressed.<br><br>The cafe itself is decently sized with seating for 30. They had some kind of retro theme throughout the place though I didn&#39;t (or couldn&#39;t) really pay attention to it. Given that it was a Thursday evening, there were a fair number of people - mostly post partiers with the occasional sketchy dude loitering about. <br><br>Value-wise, it&#39;s decent enough at $8. By no means was it a filling meal but it stopped the stomach grumblings - at least until I could get to a Denny&#39;s or Timmy&#39;s. If you&#39;re partying along Granville, you can&#39;t go wrong with this place but in all other scenarios, there&#39;s other places you could go.",
