"rating":"4.0",
"reviewcomment":"Talk about your old school neighborhood butchery, this has got it going! From the big sign on the side of the aging 2 story building, right down to the meat counters inside filled with butchered meats, cheeses, and practically all things deli.<br><br>I had a wine pairing opportunity around the corner from here, and while the wine tasting experience was great, the cheese and charcuterie it was paired with was just over the top. Besides wanting to purchase their wines, I also inquired about buying the salami and cheese; but our winekeep said they don&#39;t sell them, but brings it in from the butcher around the corner, and hence there I was standing in an old school butcher shop.<br><br> Picked up a Smoked Guinness Cheddar, and a spiced Truffle Salami. <br><br>A mildly smoked cheddar with swirls of dark Guinness, looking something like a fudge revel ice cream. A Chardonnay pairing must.<br><br> The salami was like a salty, sweet, fatty, meaty taste of heaven with a spicy kick that made my mouth do saliva cartwheels...... tru-dat!!!! Along with my Meritage... knocked it out of the park.<br><br>Wine, hard breads, olive oil, with balsamic vinegar, makes life good.... add nice cheeses, add tasty charcuterie and life becomes a ball!",
