"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/JunpmpL3iJ3rem08zU1vmQ/l.jpg",
"rating":"3.5",
"reviewcomment":"I am posting another review on The Dime.<br><br>This is to all posters who have made a comment concerning the menu choices. Â  <br>First of all.... Â  It is a small menu --yes--...but to have such a place with $4.95 choices...what did you expect????? Â  It is a small, quaint place that offers 15 meal choices for $4.95. More choices make more overhead which means raising menu prices. Â  Â  If you want more choices for your dinner...then go another place.... Â Heck...go across the street to Marcellos where you can spend $30 for your ONE of your choices. Â (then again....read Marcello&#39;s reviews before you go...you can save that $30 and may feel that The Dime is not that bad after all.) Â  <br>To make the comment that there is not enough vegetarian or vegan dishes....?...???..?..?... Â As a vegetarian of 18 years... I was VERY surprised that I actually had a CHOICE on the menu. Out of the 15 items offered, I had the choice of 5 dinners and 4 salads. Â  WOW. Â  9 out of 15 items that a vegetarian can order!!!!. Â How much more do you want from a meat eating society &amp; pub??? Â And all for $4.95 each. Â  Â  Â  That is such a rare occurrence. Â  So to complain that a place that offers a $4.95 menu with 9/15 items vegetarian......and Â does not offer enough veggie dishes...uummm Â I think you are in the wrong place. Â  And as for VEGAN dishes...well...then you really need to go to a vegetarian/vegan restaurant. Â Next thing you&#39;ll complain about is that there are no gluten-free items.... Â sheesshhhh when does it end???<br><br>To The Dime.... Â  keep it up.... Â !!!",
