"rating":"4.0",
"reviewcomment":"I have to say, I still think about these gyros and my trip to Vancouver was over two years ago. In that case, I think it deserves a solid review. My friends and I were visiting from Colorado and main drunken munchy here in Colorado is Pho. I don&#39;t think we deviated much from that. Sometimes, I would go grab a burrito, sometimes, I would get some middle eastern food but it was rare, until I came here with my friends on a short visit. HOLY MOLY, we literally stopped by Donair King every night, given these nights usually involved heavy drinking! They hands down had the best gyros I&#39;ve ever had, but that could be the drunk munchies talking. The lamb was phenomenal and the pita was just perfectly krispy in a way I never had it before! I can&#39;t find that anywhere in Colorado and it&#39;s so sad! Regardless, I would definitely try to relive this experience again on my next visit to Vancouver. We shall see how that pans out! Meanwhile, I&#39;m still searching for a gyro to satisfy my cravings.",
