"rating":"4.0",
"reviewcomment":"I&#39;ve walked by this place a dozen times before I realized it was a restaurant. Walking down the Drive and I&#39;m like, &#34;Ooh, there&#39;s some fancy street art!&#34; Only did I ever consider the painted bricks to house a restaurant inside. So my girlfriend and I decided to have a &#34;date night&#34; here last May Long weekend.<br><br>All the dishes are plenty big for the price and the tandoori chicken was fantastic, if it was on the bone. Otherwise the boneless bits were on the dry side. The naan was merely OK, not a glutenous and chewy as I expected. <br><br>Check out the daily drink specials. We had a bottle of wine for $22.50 instead of $30 on a Monday. <br><br>Service was friendly and prompt. No complaints whatsoever.<br><br>This is my recommendation for Indian food on the Drive. They also do free neighborhood deliveries!<br><br>It&#39;s interesting to see the varied reviews here. Do yourself a favor and try it out for yourself!",
