"rating":"3.0",
"reviewcomment":"A perfect place to sober up after any Yelp party. Hands in the air for Korean Fried Chicken yo&#39;ll!<br><br>We started out as 4 people, sharing a Zabu Soy Original (whole chicken) and 6 drumsticks of Zabu Hot Sticks. Two more people came, so we ordered a beef short rib BBQ style on hot grill plate.<br><br>Zabu Hot sticks came first. They were spicy but still within reason. I find the &#34;spiciness&#34; over powered the taste of other seasonings but the crunch was there, with a light coating of sticky Â spicy dressing. The Zabu Soy Original came next. I was impressed by how evenly all the cut up pieces were. Somebody back there knows how to butcher these birds right. Though I have to say as a whole chicken, it felt the portion was rather small. Crispy skin, sticky soy sweet sauce lightly coated the skin, tender, juicy meat and not oily what so ever. Short ribs were ok. Could have used more time in the marinade. <br><br>This is first place that didn&#39;t serve up kimchi as a side. We got a dish of pickled daikon and chiffonade of green and red cabbage.<br><br>Solid KFC in Vancouver, but still, New York one kicks ass.",
