"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/rM4yLcE2ag010VmiBersDA/l.jpg",
"rating":"3.5",
"reviewcomment":"Spaghetti alla Puttanesca (spaghetti with DOP tomato sauce, garlic, anchovies, black olives, capers, and parsley) $18 4/5 - Al dente! Â A little on the salty side. Â Garlic was not too strong.<br>Spaghetti alla Carbonara (typical recipe from Lazio made with free range eggs, guanciale and Pecorino) $18 1/5 - It was undercooked! Â The middle was still hard. Â We had to send it back to the kitchen. Â On the second attempt, it was still undercooked. Â Not as bad as the last time. Â I just had a bite of it. Â The second attempt was saltier than the first one for some reason. Â We would expect that&#39;s the way they serve if we didn&#39;t had the Puttanesca. Â <br>Ravioli alla Piemontese (handmade ravioli stuffed with beef served with Piedmontese sauce) $22 3.5/5 - I had high expectations for this because it was handmade. Â I could barely taste the beef. Â There were about 20 pieces pieces of raviolis.<br>Quattro Stagioni (tomato, mozzarella, cooked ham, mushrooms, black olives with pits, artichokes, anchovies) $20 3.5/5- very similar to the Prosciutto e Funghi. Â The artichokes were a little too salty. Â I don&#39;t remember having any anchovies. Â It was thicker than the Prosciutto e Funghi.<br>Prosciutto e Funghi (tomato, mozzarella, cooked ham, mushrooms) $17 4/5- my favourite of the 3 pizza. Â It was plan and simple. Â Very thin crust.<br>Pancetta &amp; Gorgonzola (tomato, mozzarella, pancetta, gorgonzola) $17 3.5/5 - simple but the pancetta was salty.<br>Panna Cotta (an Italian classic dessert made with real vanilla beans. Â Served as a chilled disk with strawberry sauce and chocolate sauce) $8 4.5/5 - Nothing much can go wrong with a panna cotta. Â The bottom of the panna cotta (or the top since it was upside down) was harder than the top. Â I have no idea how this could happen. Â Both the strawberry sauce and the chocolate sauce was a little too much for me. Â I would prefer to pick one.<br>Tiramisu (made with Italian savoiardi lady biscuits dipped in espresso, Italian Mascarpone and flavoured with cocoa) $9 4/5 - not too sweet. Â  I wish the mascarpone cheese was thicker. Â <br>Chocolate Brick (a typical Italian dessert prepared with biscuits and cocoa, crunchy and tasty) $7 3/5 - reminded us of Oreo. Â It was more on the hard side than crunchy.<br><br>The portions are on the smaller size even though our server claimed they were 12&#34; pizzas. Â The toppings were not spreadout evenly on the top. Â Some of us liked it that way and said she could pick and choose the toppings she wanted. Â The 5 of us shared 3 Madness Wednesday special (pizza+pasta+dessert for $35). Â We were told that the special is enough for 2. Â Service was a little slow. Â We waited 40min for our pizza after having the pasta. Â Our server Matteo was super nice and funny. Â We had a girls&#39; talk and at the end Matteo told us that women in Vancouver are not happy. Â He suggested we should go to Italy to look for our husbands! Â He also didn&#39;t charge us our undercooked carbonara.",
