"rating":"4.0",
"reviewcomment":"I&#39;ve been here a number of times as I live in the area. The owners are very kind, always considerate of their customers and are straight with you. While it can get really busy and the wait times can be long (45 minutes is something I&#39;ve heard multiple times), they are very courteous and tell you when it will be available and will phone you if you wish. <br><br>As for the food, my go-to baguette must be the schnitzel! The combination of flavours are to-die-for. Very crispy baguette, it&#39;s probably my favourite part! The housemade soups that aren&#39;t loaded with cream are also quite delicious. I love dipping my sandwiches in them.<br>I also frequently get their breakfast, with poached eggs, slices of tomatoes, and their potato hash. I love getting this, as it fills me up without feeling all heavy and bloated. Great starter to the day.<br><br>Overall, I love coming to Chez Meme. I&#39;m glad a place like this opened in North Burnaby :)<br><br>PS: The blankets on the chairs add a nice, cozy touch. Almost feels like home.",
