"rating":"4.0",
"reviewcomment":"Best restaurant I&#39;ve ever been to. My boyfriend and I ate here the other day and the service was on point, never did we feel smothered by the staff but they were always there right when we needed a plate cleared etc. I also have a food allergy and never has a restaurant been so accommodating and careful about my anaphylaxis as Five Sails.<br><br>Not only was the service great, but the food was cooked perfectly. Seafood is hard to cook perfectly, especially shellfish and scallops. I ordered the catch which was a sampler of a scallop, half a lobster tail, a crab claw and a hefty chunk of halibut in a coconut sauce with assorted veggies. And as compliments from the chef an ahi tuna tartar and carrot soup which was honestly the highlight of the food of the evening. <br><br>And for dessert we had the lux lemon mille feuille which was honestly the best ending to the perfect night of food. <br><br>I definitely recommend Five Sails and will be coming back!",
