"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/gquyXl-HatWwlFAbdD6zFg/l.jpg",
"rating":"3.0",
"reviewcomment":"EXP is a great little place with a solid video game theme, but what&#39;s key is that it doesn&#39;t really on that theme as it&#39;s only merit. Vancouver and their out-dated liquor laws make it hard enough to make it, let alone if you want to have video games and booze in the same place, but they&#39;re pulling it off with grace.<br><br>The owner and the staff are all super excellent, friendly, helpful and passionate about the place and that kind of thing goes a long way for a positive dining/drinking out experience.<br><br>For a bar they have a pretty extensive and unique food menu, and some really tasty and clever mix-drinks.<br><br>I see reviews and have heard people say that they think the execution isn&#39;t strong enough, and that since it&#39;s a &#39;theme bar&#39; there should be more focus on video games, but this isn&#39;t Chuck E. Cheese. It&#39;s a lounge, and they keep a nice running theme without being cheesy. <br><br>And before you assume I am writing this from the point of view of a non-gamer, think again. I am basically a big fat neck beard covered in Mountain Dew, in a small woman&#39;s body.",
