"rating":"4.0",
"reviewcomment":"During lunchtime, this place can be a zoo. Avoid it at these times if at all possible.<br><br>Their sushi is what one might expect of decent, cheap sushi. But the price is quite fair, especially for the downtown location, so I&#39;m giving this 4 stars instead of 3.<br><br>Staff are mostly Korean, not that this is a problem, but thought I&#39;d point it out because it seems to matter to some people.<br><br>Order at the counter, put on number on your table and someone will bring you your food. Self serve water and tea, bus your own tables when you&#39;re done.<br><br>In addition to sushi, they also serve noodles (udon and ramen), as well as some donburi (rice bowls). They also offer a few Korean dishes, like bibimbap and japchae, that sort of thing.<br><br>Certainly not a place to go out of your way for, but worth considering if you&#39;re in the area and are looking for a cheap quick bite.",
