"rating":"4.0",
"reviewcomment":"Went for dinner with my Peruvian boyfriend and his mother last night. Â They were a bit apprehensive about trying out a &#34;Peruvian inspired&#34; place (you know how we all like our traditional dishes to be a certain way)...but they liked it as much as I did.<br><br>To start off, we had a round of pisco sours, the traditional (alcoholic) drink of Peru. Â They shake it up with an egg white, so it&#39;s frothy on top. Â I had a drink that had pisco and ginger beer - which was equally delicious. Â It had a bit of a bite from the ginger - so beware...if you don&#39;t like ginger steer clear. Â If you love it like I do, this is the drink for you!<br><br>First up: pork belly sliders. Â Not Peruvian at all...but delicious nonetheless.<br><br>We then had some fresh ceviche. Â All of the seafood is local and sustainable (kudos!). Â <br><br>Next we had some anticuchos - which are like small kebabs. Â Some chicken on a stick, and some beef heart slices on a stick. Â Served on a bed of potato pieces with three types of sauces. Â Yum.<br><br>My favourite was the lomo. Â It&#39;s hard to screw up a lomo, which is basically a beef stir fry. Â (I think the dish originates from the sizable Chinese community in Peru.) Â The bf was perturbed to find that it didn&#39;t come with rice, which I am told it always does back home....<br><br>Lastly, we had a duck leg with beer rice. Â Sounds weird, tastes great. Â <br><br>The dishes come out as the kitchen makes them, so it&#39;s best to eat &#34;family style&#34;.<br><br>A great addition to the Vancouver food scene. Â Good food, good service, good ambiance.",
