"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/LGh2uGWcOaxTZ1MUOq_IRA/l.jpg",
"rating":"3.5",
"reviewcomment":"I gave this a try after searching around with my friend for a good place to eat around 4pm, and it was definitely worth it. We both ordered the AYCE fish and chips (11.99), which came with unlimited pop as well! I didn&#39;t have high hopes at first due to the cheap price, but I was totally blown away. The batter was very crispy, not too oily, and FRESHLY MADE. I expected it to be re fried fish since it was 4pm, but both fish and chips were fresh, not too oily/crispy; just perfect. <br><br>Service was honestly better than the food. That is quite something to say, considering the F&amp;C is definitely one of the best I&#39;ve had in this city. I totally forgot our waiter&#39;s name, but he checked back on us every so often (wasn&#39;t badgering/lacking), genuinely seemed happy and cheerful, and told my friend that bottomless pop was free, when I ordered a Pepsi. <br><br>DEFINITELY WILL COME BACK, AND EVERYONE SHOULD TOO. <br><br>P.S. when you get a refill on food, you can ask for just fish, just fish, or both :)",
