"categorystrlist":"Vietnamese",
"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/4n1g4YrRuVsU8bbjvnAldw/l.jpg",
"rating":"4.0",
"reviewcomment":"If you&#39;re craving for a nice, clear, non-heavy MSG laden bowl of pho, where you won&#39;t be fiening for a jug of water after your meal then you should give the pho here a shot. It has an incredible depth of flavours, where the cooks take their time to simmer their broth for hours until it reaches perfection to serve, unlike the other pho joints in the neighbourhood that take shortcuts by inducing tons of MSG into their broth (I&#39;m looking at you, bao chau and le petit saigon). I&#39;d rate it as one of the best in Van (Song Huong&#39;s pho is slightly better.) <br><br>$7 for a large bowl and cash only. Their inhouse chili oil is pretty kickass too. Be sure to try their spring roll and spicy house roll. Tons of parking at the front and side streets. Family-run. <br><br>Dropping one star cause the place needs new tiles and paint, starting to look run-down.",
