"reviewcomment":"I was totally blown away by their food &amp; service last night! my S/O suggested this place as it was in the neighbourhood but I hadn&#39;t been there before. We decided on take out. So I called in our order, and the gentlemen who answered the phone was SO friendly and attentive (which is not the case sometimes at other restaurants when you call to place an order) and told me about 10 - 15 minutes. When I went to pick up the order I was greeted very politely by the staff, and told it would be just a moment and offered a drink while I waited. Â Every interaction I had with a staff member was done politely, professional, and welcoming. The place was bustling for a Friday night... but everyone seemed to be on their A-game and happy to be there. <br>I got my food and took it home. <br><br>We ordered a prawn souvlaki and a chicken souvlaki. the food was carefully packaged and divided. They have a unique take-a-way tray that has individual portioned areas for the rice, vegetables, protein/potatoes. they had a separate container for the Greek salad, and another one for the tzakiki. Let me just say this... everything was awesome but the roasted potatoes blew me away. I have NEVER tasted roasted potatoes that were so good in my life. I don&#39;t know what your secret is but they were phenomenal (and I don&#39;t even usually like potatoes too much). Over all it was delicious. Portion sizes were fabulous (I have a little leftover for lunch today.. excited!), and the food was yummy! <br><br>Will definitely be back!!",
