"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/LCmBOcvZgC-1-eC60rZBEQ/l.jpg",
"rating":"3.5",
"reviewcomment":"&#34;Dear Armand, Â Thank you so much for your hospitality. Â My wife and I had a lovely time at your place and your food was so amazing and delicious.&#34; Â <br><br>That&#39;s what it feels like to eat at Lily Mae&#39;s, or at least what we felt last night. I came across Lily Mae&#39;s by accident, when I was making an early reservation on Open Table and quite frankly, it&#39;s something that should not stay a secret for too long.<br><br>From the moment you walk in, it is almost like you are having dinner at a friend&#39;s house instead of a restaurant. Â The decor, the atmosphere, it is not a stuffy restaurant and a far cry from the cookie-cutter chains that populate much of Vancouver.<br><br>The food is even better than home-cooked. Â The macaroni and cheese with duck confit was just rich enough and as an appetizer is the perfect size to be shared with one other person. Â  The duck confit makes it just slightly richer without taking over the cheesy-goodness.<br><br>The market steak was cooked perfectly and had a very lovely peppercorn aioli and complimented the steak quite nicely. Â Handcut fries and a salad make a nice accoutrements to the main course. Â <br><br>The icing on the cake was the cake: an apple pecan bacon cake. Â Apple. Pecan. BACON! Â  This dessert was the perfect topper for the meal. Â One one hand, I&#39;m very grateful I shared it with my wife because it was so good it clearly could not be good for me. Â <br><br>The decor is lovely. It looks like a nice dining room. Â It gives the meal that extra kick of character. Â One of the highlights of eating here, at least for us was Armand, the proprietor. Â He&#39;s so friendly and warm, it makes it seem like you have actually gone to a friend&#39;s house to eat. Â If I ever had to host a private dinner party, I would definitely consider trying to book out Lily Mae&#39;s and until then I&#39;ll just have to come again with friends. Â The brunch menu looks utterly fantastic.",
