"reviewcomment":"This place is A-Ok in a nutshell.<br><br>I came here with a friend on the recommendation of another friend. I got the Nachos an my friend got the Eggs Benny on special.<br><br>The nachos were HUGE, no ifs, ands, or buts about it. They were tasty, AND came with gauc (which seems to be a requirement most places forget!!). Not only was the pile huge, but it was also all nacho to the bottom (not just a layer of nachos atop a massive pile of chips). It&#39;s hard to whine about the price given the quantity and relatively good quality.<br><br>My friend seemed pleased with his meal--he certainly ate it fast enough.<br><br>The location is hard to beat, too.",
