"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/G6f-D9J3-G7CyZfwPqUGPA/l.jpg",
"rating":"3.5",
"reviewcomment":"An eggle and a cinnamon bun? Don&#39;t mind if I do!<br><br>This is one of the best places in Vancouver to stop for a snake that turns into a meal. Many reviewers compare these bagels to some where else in the country/world. Why? Who cares if I&#39;ve had better bagels in NYC, if I&#39;m in BC chances are NYC isn&#39;t my next stop.<br><br>We make due with what we got, and Solly&#39;s makes me feel good. Jewish style deli&#39;s are hard to find in the PNW so take your bagel snobbery back east. You&#39;re too stiff anyway.<br><br>In all seriousness Solley&#39;s is great food and any excuse I have to drive across the boarder I stop by here each trip. I suggest you do the same. If anyone knows a better cinnamon bun (without icing, im a purist after all) between Seattle and Van shoot me a note and I will make the trip.<br><br>Protip: If you are from south of the border like me get a Nexus. This way they are less likely to search your car and find 2 dozen cinnamon buns in the trunk. To be on the safe side have a few extra buns close at hand to slide your way through customs.",
