"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/yoPTcwGqY-13vzg2XzeO_g/l.jpg",
"rating":"4.0",
"reviewcomment":"Adorable, or most adorable?<br><br>Answering that question is the dilemma you have after checking this place out. <br><br>My cousin and I chanced upon La Petite CuillÃ¨re on our day trip up to Vancouver -- we had been attempting to get macarons from French Made Baking down the block but were too late -- on our way back we wandered into this tea shop and were not disappointed!<br><br>From our server (who is awkward in the most adorable way, like, I wish she and I could be besties sort of way, because we&#39;d be adorable and awkward and everyone else would be overwhelmed by how cute we are and we&#39;d take purikura photos where our hands form hearts and... wait, I&#39;m starting to sound like a creep. But she really was awesome!) to the tea to the food -- everything was perfect.<br><br>I classed up the place while donning my extra-fancy <a href='/redir?url=http%3A%2F%2Ftwitch.tv&amp;s=a1fad6e3cd30ae5b9b6f7d0aa6d871a597b43c68d58b4c02034e4f92115799cb' target='_blank' rel='nofollow'>twitch.tv</a> sweatshirt, but never felt as though I was being looked down upon for my fashion transgressions.<br><br>We opted for high tea. They gave us an assortment of delicious little morsels (including the only non-sushi application of tuna I have ever *enjoyed*) and I paired it with their coconut rooibos chai. Absolutely decadent, but not so heavy that I felt ill -- the perfect meal to end our trip to Canada.<br><br>They also had macarons -- I brought some back to the states with me and partook the next day -- they were all so tasty! Basically what I&#39;m saying is, everything was amazing and I can&#39;t wait &#39;til my next trip to BC so I can visit La Petite CuillÃ¨re again!",
