"reviewcomment":"Definitely one of the best Vietnamese restaurants in Vancouver. Been a customer for over 10 years, with long breaks in-between, but nonetheless, if you&#39;re craving for a great bowl of Pho. It can definitely be found here. Everything from the rice noodles to broth and condiments is cooked to near perfection. It&#39;s one of the best. Did I mention that a large bowl is only $6.50? That&#39;s unheard of in 2014. That&#39;s the price you&#39;d pay for a small bowl at other Vietnamese restaurants. Their Bun Bo Hue is also a very solid choice, definitely one of the better BBH in the city. Cafe Xue Hue and Thai Hang still reigns better though. There&#39;s parking in the back and lots of street parking on the side. The decor reminds me of a Hawaiian/Latino restaurant due to the use of vibrant colors. Nonetheless, the restaurant serves very solid, legit, authentic, rustic Vietnamese food with great value. Some restaurants don&#39;t even serve Pork blood and Pig Knuckles in their BBH, but not this restaurant. Their Beef 7 Ways for 2 people is also a very popular dish, but I haven&#39;t gotten around to trying it yet though. Oh yeah, they also don&#39;t charge tax.<br><br>One star is subtracted for cleanliness, but I&#39;m just being picky. It&#39;s comparable to most Vietnamese restaurants.",
