"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/8qoad47J7giHpmE-NAShcw/l.jpg",
"rating":"4.0",
"reviewcomment":"Generally I find ordering takeout a disappointing experience. Â I always have high hopes for delicious food fast when ordering, but get bland, lukewarm, unattractive food upon arrival, usually well past the estimated delivery time. I am happy to report that Thailicious is an exception. Â <br><br>At 6pm on a Friday night I placed an order for (1) Spring rolls, (2) spicy crab fried rice, (3) spicy basil noodles, and (4) red chicken curry. Â Less than 45 minutes later I had piping hot food delivered at my doorstep with a smile. Â  Â  Â As others have noted, the spring rolls are excellent -- crunchy with a lot of filling. Â The crab fried rice and basil noodles (which I requested to be &#34;hot&#34; on the spice scale), were pleasently spicy and I would have no hesitation ordering again. Â The red chicken curry was a little lacking in substance (could have used some more chicken and veggies), but the flavour was spot on. Â  <br><br>Prices were a little higher than some of the other delivery spots but the quality was better and, overall, the portion sizes were generous --- 2 of us managed to squeeze 2 dinners and 2 lunches out of this order, which came in at $43 after tax and tip (though we used a coupon for $8 off with <a href='/redir?url=http%3A%2F%2Forderit.ca&amp;s=6358078f83a4592e35de54b6cb1fe9cee1ed9216edbdca71a224211cd90d7b54' target='_blank' rel='nofollow'>orderit.ca</a>). Â This is definitely the best delivery experience I&#39;ve had in Vancouver and I will be ordering again soon!",
