"rating":"4.0",
"reviewcomment":"We came in for the Buck a Shuck Sundays.<br><br>The restaurant opens at 5pm and we were the first of 2 tables.<br><br>We started off with 1 dozen of oysters to see which kind we like, they have Read Island - creamy small oysters and Saw Mill Bay - slightly larger and Â saltier.<br><br>We decided we like the Read Island oysters better so we ordered another dozen.<br><br>The first dozen came pretty fast, and the second dozen took a bit longer even though there are only 2 tables in the whole restaurant.<br><br>We order a Deschutes Ale to compliment our oysters, it was very refreshing and light with no after taste.<br><br>Next, we decided to try their Sirloin Slices off their Tapas Menu, Thyme and Peppercorn with Boar Bacon and Tiger Blue Cream, cooked perfectly medium rare, nicely season but not overwhelming, and who doesn&#39;t like bacon. Personally, I am not crazy about the Blue Cream but my DH likes it.<br><br>My DH wants to drop 1 star as the manager and the bartender were busy training staff and were not as attentive as we were the only table. There were 3 wait staff, the bartender, and Nick, the manager on the floor. Â He feels that regardless if you are training staff, paying attention to the patrons should be on the top of the list. We overheard the other table asking for the bill twice.<br><br>Anyhow, this is a nice restaurant that is worth another visit. Â Thursday is $5 mussels special, they have three different ways of cooking it.",
