"reviewcomment":"A completely respectable slice of pizza downtown...fast becoming a regular cheap lunch break spot for me!<br><br>I usually order the two slice + pop combo, which comes to $6 after tax. I would agree with other reviewers who say to grab a piece of whatever is coming out of the oven if you are able. I ate a fresh-out-of-the-oven slice of plain cheese pizza last Friday and it was sooo good. The crust is nice and thin and there is barely any grease to be seen...if there is a spot of grease, it would only be from a topping like cheese or pepperoni. If you eat in, be sure to use some of the garlic ranch sauce for your crust.<br><br>I also find the service really friendly! <br><br>While I have not tried the whole pizzas, I can tell you that the next time my friends want to order pizza downtown for takeout or delivery, this will be my recommendation. I&#39;d love to try some of the more gourmet combinations.",
