"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/4rrwsaV23SxsqWVjvVoBTA/l.jpg",
"rating":"3.5",
"reviewcomment":"O.M.G. <br><br>As Edible Flours pops up in my places I have been and yelp is prompting me to review I remember why I love Vancouver so much. Why Vancouver is trying to steal my heart that Hawaii holds so dear. Vancouver has so many vegan friendly options and on both my trips this summer to Vancouver I made sure to try as many of them as I could. <br><br>Edible Flours I tried on my second trip to Vancouver. Lucky for me it was within a mile of where I was staying. So I used my handy dandy yelp - mapped the directions, checked the hours and off I went. I walked around the block, because I truly stink at finding locations even with a map. It is embarrassing, I know. My husband gives me a hard time each and every time I have to navigate (But yet he still lets me navigate.... Geez). This time though, I didn&#39;t have him with me to correct my poor navigation skills. Hence why I walked around the block. Ooops. <br><br>When I finally found It I was so excited. I love dessert and even better this was dessert that followed how I eat! <br><br>Cue disappointment music. <br><br>They were closed. They were gone for vacation. I might have considered crying. This was my ONLY day I was going to be done with training (The real reason I was in Vancouver the second time was training for work!) while they were still open. And I just walked a mile for no reason and I had to make the trek back to the condo empty handed. <br><br>Fail. <br><br>Fast forward a couple days. <br><br>I finished my work training almost 2 full days early so what did that leave time for??? Edible Flours! I walked my butt off from training to Edible Flours the day I got done early (2.5 miles from where I was training to amazing eats)... And I did it because I remembered the sign on the door saying they would be open and back from vacation! YAY!<br><br>I am SO glad I did. Service was very friendly. I ordered multiple items - some I ate right then in the cafÃ© others I took with me to chow down on when I got back to the condo. <br><br>Everything I had was amazing. I would go back again and take one of everything. My pocket book wishes I was kidding. Next time I&#39;m in Vancouver I guarantee I will be back.",
