"rating":"3.5",
"reviewcomment":"I fell hard for Brado and their poutine. Sure, I may be no expert in the world of poutine BUT I do know that I wanted more and was super sad I shared. We did a mini-poutine crawl and this place really hit all points of foodie bliss. The morsels of goodness were like little angels that spread their wings and flew me to heaven in the quick 5 minutes we inhaled this dish. The gravy is flavorful and satisfying, french fry texture was on point and the &#34;squinky noise&#34; of the cheese curds were legit.<br><br>Sure, the staff isn&#39;t great and it looks like a fast food stop for pizza but don&#39;t bypass and make a quick pit stop.<br><br>In all seriousness, this place is on my TO DO list once I&#39;m back in B.C. and if you live local to spot, well god bless your little hearts.... seriously.... you&#39;d probably have to pry me away from this place.",
