"reviewcomment":"I went with a friend who bought a Groupon. We initially went up the wrong staircase of the same building, but the restaurant was just up another staircase around the corner on Alberni St. When we arrived, we were sat down in a room with other Groupon customers (so I can&#39;t give a review for what they serve full price here). <br><br>The 10-course meal included green salad, a delicious lobster miso soup, a bit of Atlantic lobster, prawns (I think this was my 3nd fave besides the lobster and soup), small bit of foie gras served on toasted bread, bit of juicy AAA beef tenderloin pieces, bit of salmon, some stirred fry veggies and beef fried rice to fill us up. There was also ice cream at the end. <br><br>The chefs didn&#39;t give much of a performance, but I had lots to talk about with my friend and didn&#39;t mind the lack of a show. Our chef did often acknowledge us with a polite smile when she served us our food, and the servers came often to fill up our waters.<br><br>My friend and I both have small appetites, so we were pretty satisfied with the portion. I did enjoy the noise level being low for us to talk and the seats being not too cramp, even though it was bar style around the cooking grill table. I did notice this was a Chinese run restaurant when I overheard the servers taking down reservations on the phone as I was leaving. I would skip the mint at the door because that was awful tasting.",
