"reviewcomment":"Let&#39;s be clear, Sunrise is not to be confused with a gourmet or Neapolitan style pizzeria. This is as old school as it gets and within this context it remains my favourite in Vancouver.<br><br>A tad bready but that&#39;s old school. No skimping on the toppings. Cheese, and lots of it, a good homemade sauce, always piping hot when delivered and always delivered in good time. But if you want the true experience go for dine-in. Classic 70&#39;s look to the building, super friendly servers, and an authentic old school vibe. <br><br>If you want the Neapolitan experience, and I often do, head for Via Tevere. But if you want a fresh, hot, satisfying and substantial pie then Sunrise is the best in the city.",
