"rating":"4.0",
"reviewcomment":"I can&#39;t avoid bragging when it comes to Mexican food. Tacos in particular. Reasons are obvious: from the street, &#34;I hope it&#39;s beef, but you&#39;re delicious&#34; tacos in the darkest parts of Mexico City to the delicious, &#34;I hate the weather but it&#39;s worth it&#34; tacos in Hermosillo. I&#39;ve been all through the country in a personal mission to find the best tacos.<br><br>I will not say this place comes close to the best tacos in Mexico. But of all the places I&#39;ve been outside of my home country (including the US), this is food-wise the best. Hands down. That&#39;s it.<br><br>The 4 stars are because each and every single time, the service does not meet expectations. Be it that they don&#39;t answer the phone when trying to order delivery (and yes, I tried and kept trying for like an hour), or they answer in bad mood, or the guy who&#39;s taking orders in-place has a grumpier face than my grandma (and now THAT&#39;S something)...<br><br>So yes, be prepared for a religious-like taco experience that could be beyond perfect if they only worked in their customer service.<br><br>PS - The beans are free. And delicious.",
