"rating":"3.5",
"reviewcomment":"Came here with a few friends to grab drinks and snacks in December &#39;13. With $10 triple Long Islands and a location close to UBC, you know it&#39;s going to be a hit with the student clientele-which is exactly the category that we fell under. Our waitress was prompt and attentive. It was a Monday evening and the place was fairly empty, so she was able to seat us right away and made us feel at ease. The Long Islands are large (think enormous beer mugs) and delicious, but definitely do not have thrice the alcohol content as one Long Island. That&#39;s probably a good thing. Oh, and the nachos: those are phenomenal. Liberally stacked with cheese, meat and guacamole, and accompanied by salsa and sour cream, this is a snack-well, to be entirely honest, it turned into a meal for us-worth breaking your diet for. Fortunately, Coppertank is located right on a bus line, so you&#39;re good to go even if you have a couple of drinks too many. I had a good evening out on my visit, but I&#39;m not sure if I&#39;d come back once I stop being a student.",
