"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/w_PKIbr51H-HQxj_JX7dTw/l.jpg",
"rating":"3.5",
"reviewcomment":"*Elderly Chinese parents approved*<br><br>After my last debacle here:<br><br><a href='http://www.yelp.ca/biz/deer-garden-signatures-vancouver#hrid:5KXkeuJ_TSwBwDj2CbKaDQ'>yelp.ca/biz/deer-garden-â¦</a><br><br>I was pretty hesitant for a repeat occurrence at a Northern Chinese styled restaurant with Ederly Chinese Dad who happens to be a Canto-cuisine-o-philic person and as weird as it may be, he dislikes almost everything non-Canto. Â Tough person to please. Â However, I persevered and it paid off.<br><br>The ace in my pocket was the beef rolls. He likes beef and Hoisin sauce. Â Another bonus, they speak Canto and Mando. Â That put him right into his comfort zone<br><br>I ventured out of my creature of habit tendencies with this visit. Â I ordered a bunch of stuff that I would normally not order at a Northern Chinese joint along with some familiar faces.<br><br>Seafood tofu soup: Â This was pretty much a Canto dish<br>Mu-Shu Stir-fried Noodles<br>Beef Rolls<br>Tan-tan Noodles<br>Cilantro Lamb<br>Stir fried Sichuan A-Choy<br>Stir fried Chinese Rice Cakes<br>Threaded Bun Roll - I asked for deep fried and it comes with sweetened condensed milk for dipping. Â My daughter licked this one clean.<br><br>Standouts?<br>Mu-shu stir fried noodles: Â blade sheared fresh noodles with a gentle, light, clean tasting sauce. Â I enjoyed this one very much.<br><br>Cilantro stir fried lamb: Â Thinly shaved lamb stir fried with cilantro bean paste and chili flakes. Â Not gamey with a hint of heat.<br><br>Sichuan A-Choy: Â This is also known as Taiwanese lettuce or sword lettuce. Â (thank you Google) Â Never had this before and I quite liked it. Â Similar texture and taste to romaine lettuce. Â I&#39;d order this again.<br><br>All in all, a successful evening with Elderly Chinese parents. Â No complaints at all. Â They liked the food overall more so than at Deer Garden, even though it was pricier. Â  Peaceful gets their stamp of approval. Â **Sarcastic** Â Wow!<br><br>Service was well above average for a Chinese joint, which are infamously known for crappy service. Â Very friendly and accommodating.",
