"reviewcomment":"Yes...be as it may I didn&#39;t want to have to be in a long lineup trying to get a table for mother&#39;s day dinner. Â I also didn&#39;t want to have to sit at a table for a number of hours to wait for my food to come out due to the mass hysteria of people eating out at all the local restaurants really. Â So where did I go? Â Grabbed take-out from this wonderful place my sister always told me about and it did not disappoint.<br><br> Â For just the 3 of us we ordered a side order of Uni Sushi (one of my mom&#39;s favourite) and the notoriously good (cause I loved everything in it...none of that..oh there is a certain item in that tray that I don&#39;t like or eat etc) Fujiyama tray.<br><br> Â Since we ordered it the day before we had the 10% off deal. Â Service was great from when I placed the order over phone to showing up and paying in person. (compliments to the cashier staff there)<br><br> Â All of us found all items great and fresh. Â Only minor downside though was that we were all quite thirsty afterwards...we can only assume there was some sort of msg in the soy sauce (not in packet form) that was provided? (Since we used very little soy sauce I can&#39;t fathom what else it could&#39;ve been except the warm weather?)<br><br> Â Price point wise, quality food and great service will definitely help me make a decision easier next time I need take-out. Â Move over Samurai Pizza Cats...here comes Samurai Sushi! (Lame geek joke alert!) Â Please disregard last remark if not funny. :(",
