"rating":"3.5",
"reviewcomment":"I cannot remember when was the last time I was at a mediterranean restaurant. Â My friend wanted to try something new for the Vancouver Dine-out this year around. Â So I chose Sol Sun Belt Cookery, after two hours of restaurants shopping on <a href='/redir?url=http%3A%2F%2Fwww.dineoutvancouver.com&amp;s=d0df02d5e123e37310d2029dd087f3849342c002e96f12b059d68fd2be53570b' target='_blank' rel='nofollow'>dineoutvancouver.com</a> and cross referencing on Yelp.<br><br>The research sort of paid off. Â I was pleasantly surprised by the food. Â We ordered some appetizers, tapas, Grilled Mackerel, and Confit of Duck Leg. Â They are all delicious. Â The quality of food is top notch, and I really appreciate their recommendation of wine pairing. Â <br><br>My one recommendation will be that the server could be more detail orientated. Â  I think it was apparent we didn&#39;t know much about mediterranean food and were scratching our heads for ideas. Â Our server just stood there and did nothing. Â It was a bit awkward to say the least. Â <br><br>All in all, we were happy about the food, service, and location. Â Too bad it was too dark to see any view.",
