"reviewcomment":"What what? This place is a Â solid 4 stars! I was a bit hesitant after reading Joshua&#39;s review, but it was recommended a few time by friends so we stopped by for lunch as a group of 7.<br><br>They seemed a bit flustered when we arrived since we were so many people, but they got through us at a surprisingly decent speed. I ordered the Vancouver Roll (real crab meat and avocado, salmon and tobiko on top) and the volcano roll (tuna and crab meat, deep fried with spicy sauce on top). <br><br>Other items that were ordered was the New Mexico Roll (jalapeno peppers mixed into a sushi roll), black cod cheeks, awesome roll, lunch specials, cheese gyozas, chicken karaage. The food was all good but people said the New Mexico Roll wasn&#39;t as spicy as they were hoping for (even though the sign said super spicy, and the server said super spicy). I thoroughly enjoyed my two rolls, and the prices were decent as well.<br><br>A good option to stop by for a lunch if you&#39;re around :) You can get here by taking the 14 or 16, or walking a bit form the 135. There&#39;s a parking lot out front if you&#39;re driving.",
