"rating":"3.5",
"reviewcomment":"Great location in the heart of the Olympic Village and right by False Creek, it can get pretty chaotic on the weekends, but I always enjoy the people watching.<br><br>This was only my second time here, but I had to write a review because their customer service was so on point. I had ordered a portobello mushroom and goat cheese salad and my friend had ordered a margherita pizza. The pizza arrived first, which made us wonder why my salad was taking so long. But we soon realized that they had made a mistake and thought that I had ordered a portobello mushroom pizza instead of the salad. When the server came over with the mushroom pizza, I told her that I had actually ordered the salad. She apologized immediately, asked me for my order number and said she would be right back.<br><br>The way she went about correcting their mistake is what blew me out of the water. When the server returned, she had brought over a brownie and said it was on the house. And since the salad was a few dollars less than the pizza, she also gave me the exact difference back in change. She apologized again and left me sitting there in awe. Honestly, she could have just thrown the brownie at me and I would have devoured that thing with a grin on my face. What change? Who the F cares! That was awesome, and she did it all without batting an eye.<br><br>Oh yeah, the salad was quite tasty too.",
